    			li5 = element("li");
    			t88 = text("Full defense is presented as optional and has been altered a bit to accommodate the expanded scope of the defend action (");
    			strong9 = element("strong");
    			strong9.textContent = "page XX";
    			t90 = text("). Other standard rules options are presented as well, starting on ");
    			strong10 = element("strong");
    			strong10.textContent = "page XX";
    			t92 = text(".");
    			t93 = space();
    			h13 = element("h1");
    			h13.textContent = "Getting Started";
    			t95 = space();
    			hr4 = element("hr");
    			t96 = space();
    			h21 = element("h2");
    			h21.textContent = "Define Your Setting";
    			t98 = space();
    			hr5 = element("hr");
    			t99 = space();
    			p14 = element("p");
    			p14.textContent = "Any game of Fate starts with defining your setting. This might be a concept your GM is bringing to the table, a popular media property the players are familiar with, or a collaborative world-building exercise involving everyone at the table. The setting discussion may be quick and light on detail, or may involve a detailed full session with the whole group, or anything in between.";
    			t101 = space();
    			p15 = element("p");
    			p15.textContent = "Your choice of setting forms the basis of the tables consensus about what is true, and what is acceptable in play and in character concepts. If your setting doesnt have flying people in it, then a player deciding to make a flying-person character doesnt pass muster. If your world involves shadowy organizations and deep conspiracies, players may expect story-lines free of clear-cut good-and-evil conflicts and devoid of farcical murder-clowns. Its up to you!";
    			t103 = space();
    			h22 = element("h2");
    			h22.textContent = "Create Your Characters";
    			t105 = space();
    			hr6 = element("hr");
    			t106 = space();
    			h31 = element("h3");
    			h31.textContent = "Who Are You?";
    			t108 = space();
    			p16 = element("p");
    			p16.textContent = "Once youve decided on a setting, its time for the players to make charactersalso called PCs. Each player takes on the role of one of the heroes of your story, controlling all their actions. You get to build the character you want to see in the world. Keep in mind that Fate characters are competent, dramatic, and willing to engage with the adventures ahead.";
    			t110 = space();
    			p17 = element("p");
    			p17.textContent = "Your PC is made up of several elements:";
    			t112 = space();
    			ul1 = element("ul");
    			li6 = element("li");
    			strong11 = element("strong");
    			strong11.textContent = "Aspects:";
    			t114 = text(" phrases describing who your hero is");
    			t115 = space();
    			li7 = element("li");
    			strong12 = element("strong");
    			strong12.textContent = "Skills:";
    			t117 = text(" your heros areas of relative expertise");
    			t118 = space();
    			li8 = element("li");
    			strong13 = element("strong");
    			strong13.textContent = "Stunts:";
    			t120 = text(" remarkable things your hero does");
    			t121 = space();
    			li9 = element("li");
    			strong14 = element("strong");
    			strong14.textContent = "Stress:";
    			t123 = text(" your heros ability to keep calm and carry on");
    			t124 = space();
    			li10 = element("li");
    			strong15 = element("strong");
    			strong15.textContent = "Consequences:";
    			t126 = text(" the wounds, physical and mental, your hero can endure");
    			t127 = space();
    			li11 = element("li");
    			strong16 = element("strong");
    			strong16.textContent = "Refresh:";
    			t129 = text(" a measure of your heros narrative agency");
    			t130 = space();
    			li12 = element("li");
    			strong17 = element("strong");
    			strong17.textContent = "Finishing Touches:";
    			t132 = text(" your heros personal details");
    			t133 = space();
    			h32 = element("h3");
    			h32.textContent = "Aspects";
    			t135 = space();
    			p18 = element("p");
    			strong18 = element("strong");
    			strong18.textContent = "Aspects";
    			t137 = text(" are short phrases that describe who your character is or what is important to them. They can relate to your characters physical or mental qualities, history, beliefs, training, relationships, or even particularly important equipment.");
    			t138 = space();
    			p19 = element("p");
    			t139 = text("The first thing to know about them is: ");
    			strong19 = element("strong");
    			strong19.textContent = "Aspects are true";
    			t141 = text(" (see ");
    			strong20 = element("strong");
    			strong20.textContent = "page XX";
    			t143 = text(" for a discussion of this). In other words, how you define your character is real and true in the story youre telling. If you write down that your character is a ");
    			strong21 = element("strong");
    			strong21.textContent = "Precog Sniper";
    			t145 = text(", then they ");
    			em7 = element("em");
    			em7.textContent = "are";
    			t147 = text(" a precog sniper. Youve told everyone that your character sees the future and is a crack shot with a rifle.");
    			t148 = space();
    			p20 = element("p");
    			t149 = text("Youll also use aspects in play to change the story. They give you permission to improve your dice rolls and establish facts about the world. Lastly, aspects can earn you ");
    			strong22 = element("strong");
    			strong22.textContent = "fate points";
    			t151 = text(" if they create complications for your characterso to make the most versatile aspects, you should aim for ones that are double-edged, working both for you and against you.");
    			t152 = space();
    			p21 = element("p");
    			t153 = text("To learn more about aspects and what makes a good one, consider reading some of ");
    			em8 = element("em");
    			em8.textContent = "Aspects and Fate Points";
    			t155 = text(" (");
    			strong23 = element("strong");
    			strong23.textContent = "page XX";
    			t157 = text(").");
    			t158 = space();
    			p22 = element("p");
    			strong24 = element("strong");
    			strong24.textContent = "To begin, youll give your character five aspects";
    			t160 = text(": a high concept, a trouble, a relationship, and two free aspects. Start with the high concept and go from there.");
    			t161 = space();
    			h40 = element("h4");
    			h40.textContent = "High Concept";
    			t163 = space();
    			p23 = element("p");
    			t164 = text("Your ");
    			strong25 = element("strong");
    			strong25.textContent = "high concept";
    			t166 = text(" is a broad description of the character, covering the vital bits. Its how you would open your pitch for the character when telling a friend about them.");
    			t167 = space();
    			h41 = element("h4");
    			h41.textContent = "Trouble";
    			t169 = space();
    			p24 = element("p");
    			t170 = text("Next is your characters ");
    			strong26 = element("strong");
    			strong26.textContent = "trouble";
    			t172 = text("  something that makes your characters life more complicated. It could be a personal weakness, family entanglements, or other obligations. Pick something youll enjoy roleplaying!");
    			t173 = space();
    			h42 = element("h4");
    			h42.textContent = "Relationship";
    			t175 = space();
    			p25 = element("p");
    			t176 = text("Your ");
    			strong27 = element("strong");
    			strong27.textContent = "relationship";
    			t178 = text(" describes a connection with another PC. They may already know one another, or have just met.");
    			t179 = space();
    			p26 = element("p");
    			p26.textContent = "Good relationship aspects should introduce or hint at conflict, or at least an imbalance that gives the relationship a little momentum. This doesnt mean they are openly antagonistic, but they shouldnt be all roses either.";
    			t181 = space();
    			p27 = element("p");
    			p27.textContent = "If you wish, you can wait to write down relationship aspects until everyone has more or less completed their characters.";
    			t183 = space();
    			h43 = element("h4");
    			h43.textContent = "Free Aspects";
    			t185 = space();
    			p28 = element("p");
    			p28.textContent = "You can make your characters last two aspects anything you wantthere are no restrictions beyond the obligation to fit the setting. Choose anything which you think will make your character more interesting, more fun to play, or better connected to the world they occupy.";
    			t187 = space();
    			h33 = element("h3");
    			h33.textContent = "Skills";
    			t189 = space();
    			p29 = element("p");
    			t190 = text("While aspects define who your character is, ");
    			strong28 = element("strong");
    			strong28.textContent = "skills";
    			t192 = text(" show what they can do. Each skill describes a broad activity your character might have learned through study and practice or simply have an innate talent for. A character with Burglary is capable, to some degree, at all manner of crime relating to the fine art of burglingcasing a joint, bypassing security, pick-pocketing, and lock-picking.");
    			t193 = space();
    			p30 = element("p");
    			t194 = text("Each skill has a ");
    			strong29 = element("strong");
    			strong29.textContent = "rating";
    			t196 = text(". The higher the rating, the better the character is at the skill. As a whole, your characters skills will show you what actions they are built for, which ones theyll get by on, and which arent their forte.");
    			t197 = space();
    			p31 = element("p");
    			p31.textContent = "Youll choose your characters skill ratings, arranged in a pyramid with the highest-rated skill at Great(+4), as follows:";
