    			p62 = element("p");
    			strong49 = element("strong");
    			strong49.textContent = "Academics:";
    			t326 = text(" Mundane, everyday human knowledge and education, including history, sciences, and medicine. Academics stunts often refer to specialized areas of knowledge and medical skills.");
    			t327 = space();
    			p63 = element("p");
    			strong50 = element("strong");
    			strong50.textContent = "Athletics:";
    			t329 = text(" A measurement of physical potential. Athletics stunts focus on movementrunning, jumping, parkourand dodging attacks.");
    			t330 = space();
    			p64 = element("p");
    			strong51 = element("strong");
    			strong51.textContent = "Burglary:";
    			t332 = text(" Knowledge of and ability to bypass security systems, pick pockets, and generally commit crimes. Burglary stunts give bonuses to the various stages of committing a crime, from the planning to the execution and escape.");
    			t333 = space();
    			p65 = element("p");
    			strong52 = element("strong");
    			strong52.textContent = "Contacts:";
    			t335 = text(" Knowledge of the right people and connections that can help you. Contacts stunts give you ready allies and an information network wherever you go in the world.");
    			t336 = space();
    			p66 = element("p");
    			strong53 = element("strong");
    			strong53.textContent = "Crafts:";
    			t338 = text(" Ability to make or break machinery, build contraptions, and pull off MacGyver-esque feats of ingenuity. Crafts stunts let you have the gizmo on hand, give bonuses to building and breaking things, and provide justification for using Crafts in place of skills like Burglary or Academics under certain circumstances.");
    			t339 = space();
    			p67 = element("p");
    			strong54 = element("strong");
    			strong54.textContent = "Deceive:";
    			t341 = text(" Ability to lie and cheat convincingly and with aplomb. Deceive stunts might improve your ability to tell a particular breed of lie or help invent false identities.");
    			t342 = space();
    			p68 = element("p");
    			strong55 = element("strong");
    			strong55.textContent = "Drive:";
    			t344 = text(" Controlling vehicles under the most grueling circumstances, pulling wicked maneuvers, and simply getting the most out of your ride. Drive stunts can be signature maneuvers, a special vehicle of your own, or the ability to use Drive in place of a skill like Burglary or Academics under certain circumstances.");
    			t345 = space();
    			p69 = element("p");
    			strong56 = element("strong");
    			strong56.textContent = "Empathy:";
    			t347 = text(" Ability to accurately judge someones mood and intentions. Empathy stunts can be about judging a crowd, picking up on lies, or helping others recover from mental consequences.");
    			t348 = space();
    			p70 = element("p");
    			strong57 = element("strong");
    			strong57.textContent = "Fight:";
    			t350 = text(" Ability to excel at hand-to-hand combat, whether with weapons or fists. Fight stunts include signature weapons and special techniques.");
    			t351 = space();
    			p71 = element("p");
    			strong58 = element("strong");
    			strong58.textContent = "Investigate:";
    			t353 = text(" Deliberate, careful study and puzzling out mysteries. Use this to piece together clues or reconstruct a crime scene. Investigate stunts help you form brilliant deductions or piece together information more quickly.");
    			t354 = space();
    			p72 = element("p");
    			strong59 = element("strong");
    			strong59.textContent = "Lore:";
    			t356 = text(" Specialized, arcane knowledge that falls outside of the scope of Academics, including supernatural topics of one sort or another. This is where the weird stuff happens. Lore stunts often support practical applications of your arcane knowledge, such as casting spells. Some settings may remove Lore, replace it with a different skill, or combine it with Academics.");
    			t357 = space();
    			p73 = element("p");
    			strong60 = element("strong");
    			strong60.textContent = "Notice:";
    			t359 = text(" Ability to pick up details in the moment, spot trouble before it happens, and generally be perceptive. It contrasts Investigate, which is for slow, deliberate observation. Notice stunts sharpen your senses, improve your reaction time, or make you harder to sneak up on.");
    			t360 = space();
    			p74 = element("p");
    			strong61 = element("strong");
    			strong61.textContent = "Physique:";
    			t362 = text(" Raw power and durability. Physique stunts let you perform superhuman feats of strength, throw your weight around while wrestling, and shrug off physical consequences. In addition, a high Physique rating gives you more physical stress or consequence slots (");
    			strong62 = element("strong");
    			strong62.textContent = "page XX";
    			t364 = text(").");
    			t365 = space();
    			p75 = element("p");
    			strong63 = element("strong");
    			strong63.textContent = "Provoke:";
    			t367 = text(" Ability to push people to act the way you want them to. Its coarse and manipulative, not a positive interaction. Provoke stunts let you push opponents into foolhardy action, draw aggression toward you, or scare enemies (assuming they can feel fear).");
    			t368 = space();
    			p76 = element("p");
    			strong64 = element("strong");
    			strong64.textContent = "Rapport:";
    			t370 = text(" Building connections with others and working together. Where Provoke is manipulation, Rapport is sincerity, trust, and goodwill. Rapport stunts let you sway the crowd, improve relationships, or build contacts.");
    			t371 = space();
    			p77 = element("p");
    			strong65 = element("strong");
    			strong65.textContent = "Resources:";
    			t373 = text(" Access to material things, not just money or direct ownership. It might reflect your ability to borrow from friends or dip into an organizations armory. Resources stunts let you use Resources in place of Rapport or Contacts or give you extra free invokes when you pay for the best.");
    			t374 = space();
    			p78 = element("p");
    			strong66 = element("strong");
    			strong66.textContent = "Shoot:";
    			t376 = text(" All forms of ranged combat, whether guns, throwing knives, or bow and arrow. Shoot stunts let you make called shots, quick-draw, or always have a gun handy.");
    			t377 = space();
    			p79 = element("p");
    			strong67 = element("strong");
    			strong67.textContent = "Stealth:";
    			t379 = text(" Staying unseen or unheard and escaping when you need to hide. Stealth stunts let you vanish in plain sight, blend into crowds, or advance through shadows unseen.");
    			t380 = space();
    			p80 = element("p");
    			strong68 = element("strong");
    			strong68.textContent = "Will:";
    			t382 = text(" Mental fortitude, the ability to overcome temptation and to withstand trauma. Will stunts let you ignore mental consequences, withstand the mental agony of strange powers, and hold steady against enemies who provoke you. In addition, a high Will rating gives you more mental stress or consequence slots (");
    			strong69 = element("strong");
    			strong69.textContent = "page XX";
    			t384 = text(").");
    			t385 = space();
    			h46 = element("h4");
    			h46.textContent = "Alternative Skill Lists";
    			t387 = space();
    			p81 = element("p");
    			p81.textContent = "When building your own implementation of Fate, the first thing to think about is whether or not youll keep the same skill list. Often you can work with the one given, combining, changing, or splitting apart a few of the skills given. But its possible that the granularity of the default example skill list weve given above isnt to your liking. Here are some things to think about.";
    			t389 = space();
    			ul3 = element("ul");
    			li18 = element("li");
    			li18.textContent = "The default skill list has 19 skills in it, and players rate their characters above the Mediocre (+0) default in 10 of them. If you change the number of skills, you may want to change how the ratings are allocated.";
    			t391 = space();
    			li19 = element("li");
    			t392 = text("Our default skills are focused on answering the question what can you do?but your list doesnt need to follow in line with that. You might want a list focused on What do you believe?, the question How do you do things? (as with approaches in ");
    			em10 = element("em");
    			em10.textContent = "Fate Accelerated";
    			t394 = text("), job-roles in a crew of grifters and thieves, and so on.");
    			t395 = space();
    			li20 = element("li");
    			li20.textContent = "Skill ratings in Fate are structured to support character niches. Thats why, in the default, players start with a pyramid shape. Make sure niche protection is possible in whatever new list you create.";
    			t397 = space();
    			li21 = element("li");
    			li21.textContent = "The best starting skill should come in around Great (+4). You can alter this up or down as you see fit, but make sure to keep an eye on what that means for the difficulty and opposing skill ratings your PCs will face.";
    			t399 = space();
    			p82 = element("p");
    			p82.textContent = "Fred decides he wants to do a space-faring Fate game with a shorter skill list thats focused on action-words. He settles on this 9-item skill list: Fight, Know, Move, Notice, Pilot, Sneak, Speak, Tinker, and Will. He also likes the idea of a diamond shape for skill ratings rather than a pyramid, so he has players rate their starting skills as follows: 1 at Great (+4), 2 at Good (+3), 3 at Fair (+2), 2 at Average (+1), and 1 at Mediocre (+0). His PCs will have a lot of overlap and core competencies due to the fat middle of his diamond, while still enjoying some niche protections at the top of the diamonds point.";
    			t401 = space();
    			p83 = element("p");
    			t402 = text("If youre considering making your own skill list for your game and are looking for some ideas to kick-start your imagination, see ");
    			strong70 = element("strong");
    			strong70.textContent = "pageXX.";
    			t404 = space();
    			h34 = element("h3");
    			h34.textContent = "Refresh";
    			t406 = space();
    			p84 = element("p");
    			t407 = text("Your ");
    			strong71 = element("strong");
    			strong71.textContent = "refresh";
    			t409 = text(" is the minimum number of ");
    			strong72 = element("strong");
    			strong72.textContent = "fate points";
    			t411 = text(" (");
    			strong73 = element("strong");
    			strong73.textContent = "page XX";
    			t413 = text(") your character begins with at the start of each session. Your character begins with a refresh of 3.");
    			t414 = space();
    			p85 = element("p");
    			p85.textContent = "Each session, you start with fate points at least equal to your refresh. Be sure to keep track of the fate points you have left at the end of each session of playif you have more fate points than your refresh, youll start the next session with the fate points you ended this session with.";
    			t416 = space();
    			p86 = element("p");
    			p86.textContent = "Charles earned a lot of fate points during todays session, ending it with 5 fate points. His refresh is 2, so Charles will start the next session with 5 fate points. But Ethan ends the same session with just one fate point. His refresh is 3, so hell begin the next session with 3 fate points, not just the one he had left over.";
    			t418 = space();
    			h35 = element("h3");
    			h35.textContent = "Stunts";
    			t420 = space();
    			p87 = element("p");
    			t421 = text("While every character has access to all the skillseven if they are Mediocre(+0) at most of themyour character has some unique ");
    			strong74 = element("strong");
    			strong74.textContent = "stunts";
    			t423 = text(". Stunts are the cool techniques, tricks, or bits of equipment that make your character unique and interesting. Where skills are about a characters broad competencies, stunts are about specific areas of excellence; most of them give you a bonus in particular circumstances or let you do something that other characters simply cant.");
    			t424 = space();
    			p88 = element("p");
    			p88.textContent = "Your character begins with three free stunt slots. You dont have to define them all right away, and may fill them in as you play. You may purchase more stunts by spending 1 refresh each, to a minimum of 1 refresh.";
    			t426 = space();
    			h47 = element("h4");
    			h47.textContent = "Writing Stunts";
    			t428 = space();
    			p89 = element("p");
    			p89.textContent = "You write your own stunts when building a character. Broadly, there are two types of stunts.";
    			t430 = space();
    			p90 = element("p");
    			strong75 = element("strong");
    			strong75.textContent = "Bonus-granting stunts:";
    			t432 = text(" The first type of stunt ");
    			strong76 = element("strong");
    			strong76.textContent = "gives you a +2 bonus";
    			t434 = text(" when you use a named skill within certain parameters, usually limited to a specific type of action (");
    			strong77 = element("strong");
    			strong77.textContent = "page XX";
    			t436 = text(") and type of narrative circumstance.");
    			t437 = space();
    			p91 = element("p");
    			p91.textContent = "Write this type of stunt as follows:";
    			t439 = space();
    			p92 = element("p");
    			t440 = text("Because I ");
    			strong78 = element("strong");
    			strong78.textContent = "[describe how you are amazing or have a cool bit of gear]";
    			t442 = text(", I get a +2 when I use ");
    			strong79 = element("strong");
    			strong79.textContent = "[pick a skill]";
    			t444 = text(" to ");
    			strong80 = element("strong");
    			strong80.textContent = "[pick one: overcome, create an advantage, attack, defend]";
    			t446 = text(" when ");
    			strong81 = element("strong");
    			strong81.textContent = "[describe a circumstance]";
    			t448 = text(".");
    			t449 = space();
    			p93 = element("p");
    			strong82 = element("strong");
    			strong82.textContent = "Example Bonus-Granting Stunt:";
    			t451 = text(" Because I am ");
    			strong83 = element("strong");
    			strong83.textContent = "a military-trained sniper";
    			t453 = text(", I get a +2 when I use ");
    			strong84 = element("strong");
    			strong84.textContent = "Shoot";
    			t455 = text(" to ");
    			strong85 = element("strong");
    			strong85.textContent = "attack";
    			t457 = text(" when ");
    			strong86 = element("strong");
    			strong86.textContent = "I have a target";
    			t459 = space();
    			strong87 = element("strong");
    			strong87.textContent = "In My Sights";
    			t461 = text(".");
    			t462 = space();
    			p94 = element("p");
    			strong88 = element("strong");
    			strong88.textContent = "Rule-changing stunts:";
    			t464 = text(" The second type of stunt ");
    			strong89 = element("strong");
    			strong89.textContent = "changes the rules of the game";
    			t466 = text(". This is a broad category that includes, but is not limited to, the following:");
    			t467 = space();
    			ul4 = element("ul");
    			li22 = element("li");
    			strong90 = element("strong");
    			strong90.textContent = "Swapping which skills are used in a given situation.";
    			t469 = text(" For instance, a researcher might use Academics to perform a ritual, while anyone else would use Lore.");
    			t470 = space();
    			li23 = element("li");
    			li23.textContent = "**Using an action with a skill that isnt normally used with it.**For instance, allowing a character to use Stealth to backstab an opponent from the shadows (which would typically be a use of Fight).";
    			t472 = space();
    			li24 = element("li");
    			strong91 = element("strong");
    			strong91.textContent = "Giving a character a different kind of bonus to skills thats roughly equivalent to a +2.";
    			t474 = text(" For instance, when a skilled orator creates an advantage with Rapport, it gets an extra free invoke.");
    			t475 = space();
    			li25 = element("li");
    			strong92 = element("strong");
    			strong92.textContent = "Allowing a character to declare a minor fact is always true.";
    			t477 = text(" For instance, a survivalist always has survival items like matches on their person, even under unlikely circumstances. This type of stunt establishes that you do not need to invoke for story details (");
    			strong93 = element("strong");
    			strong93.textContent = "page XX";
    			t479 = text(") for the given fact.");
    			t480 = space();
    			li26 = element("li");
    			strong94 = element("strong");
    			strong94.textContent = "Allowing a character to make a specific rules exception.";
    			t482 = text(" For instance, a character might have two more stress boxes or another mild consequence slot.");
    			t483 = space();
    			p95 = element("p");
    			p95.textContent = "Write this type of stunt as follows:";
    			t485 = space();
    			p96 = element("p");
    			t486 = text("Because I ");
    			strong95 = element("strong");
    			strong95.textContent = "[describe how you are amazing or have a cool bit of gear]";
    			t488 = text(", I can ");
    			strong96 = element("strong");
    			strong96.textContent = "[describe your amazing feat]";
    			t490 = text(", but only ");
    			strong97 = element("strong");
    			strong97.textContent = "[describe a circumstance or limitation]";
    			t492 = text(".");
    			t493 = space();
    			p97 = element("p");
    			strong98 = element("strong");
    			strong98.textContent = "Example Rule-Changing Stunt:";
    			t495 = text(" Because I ");
    			strong99 = element("strong");
    			strong99.textContent = "dont believe in magic";
    			t497 = text(", I can ");
    			strong100 = element("strong");
    			strong100.textContent = "ignore the effects of a supernatural ability";
    			t499 = text(", but only ");
    			strong101 = element("strong");
    			strong101.textContent = "once per game session";
    			t501 = text(".");
    			t502 = space();
    			h36 = element("h3");
    			h36.textContent = "Stress and Consequences";
    			t504 = space();
    			p98 = element("p");
    			strong102 = element("strong");
    			strong102.textContent = "Stress";
    			t506 = text(" and ");
    			strong103 = element("strong");
    			strong103.textContent = "consequences";
    			t508 = text(" are how your character withstands the mental and physical toll of their adventures. Characters have at least three one-point boxes for physical stress and at least three one-point boxes for mental stress. They also get one slot each for mild, moderate, and severe consequences.");
    			t509 = space();
    			p99 = element("p");
    			p99.textContent = "Your rating in Physique affects how many total physical stress boxes you have. Will does the same for your mental stress. Refer to the following table:";
    			t511 = space();
    			table2 = element("table");
    			col2 = element("col");
    			t512 = space();
    			col3 = element("col");
    			t513 = space();
    			tbody2 = element("tbody");
    			tr20 = element("tr");
    			th6 = element("th");
    			p100 = element("p");
    			p100.textContent = "Physique/Will";
    			t515 = space();
    			th7 = element("th");
    			p101 = element("p");
    			p101.textContent = "Physical/Mental Stress";
    			t517 = space();
    			tr21 = element("tr");
    			td46 = element("td");
    			p102 = element("p");
    			p102.textContent = "Mediocre (+0)";
    			t519 = space();
    			td47 = element("td");
    			p103 = element("p");
    			strong104 = element("strong");
    			strong104.textContent = "[1][1][1]";
    			t521 = space();
    			tr22 = element("tr");
    			td48 = element("td");
    			p104 = element("p");
    			p104.textContent = "Average (+1) or Fair (+2)";
    			t523 = space();
    			td49 = element("td");
    			p105 = element("p");
    			strong105 = element("strong");
    			strong105.textContent = "[1][1][1] [1]";
    			t525 = space();
    			tr23 = element("tr");
    			td50 = element("td");
    			p106 = element("p");
    			p106.textContent = "Good (+3) or Great (+4)";
    			t527 = space();
    			td51 = element("td");
    			p107 = element("p");
    			strong106 = element("strong");
    			strong106.textContent = "[1][1][1] [1][1][1]";
    			t529 = space();
    			tr24 = element("tr");
    			td52 = element("td");
    			p108 = element("p");
    			p108.textContent = "Superb (+5) and higher";
    			t531 = space();
    			td53 = element("td");
    			p109 = element("p");
    			strong107 = element("strong");
    			strong107.textContent = "[1][1][1] [1][1][1]";
    			t533 = text(" and a second mild consequence slot specifically for physical or mental hits");
    			t534 = space();
    			p110 = element("p");
    			t535 = text("Youll learn how stress and consequences work during play in ");
    			em11 = element("em");
    			em11.textContent = "Taking Harm";
    			t537 = text(" (");
    			strong108 = element("strong");
    			strong108.textContent = "page XX";
    			t539 = text(").");
    			t540 = space();
    			h48 = element("h4");
    			h48.textContent = "Hang on, thats not what I remember!";
    			t542 = space();
    			p111 = element("p");
    			t543 = text("In ");
    			em12 = element("em");
    			em12.textContent = "Fate Condensed";
    			t545 = text(", were using only one-point stress boxes. ");
    			em13 = element("em");
    			em13.textContent = "Fate Core System";
    			t547 = text(" and ");
    			em14 = element("em");
    			em14.textContent = "Fate Accelerated";
    			t549 = text(" both use a series of escalating-value boxes (one 1-point box, one 2-point box, etc). You can use that style of stress box if you like; for this version we decided to stick with one-point boxes because its simplewith the other method, folks can get confused just a little more easily.");
    			t550 = space();
    			p112 = element("p");
    			p112.textContent = "There are a few other angles on this style that youll want to keep in mind.";
    			t552 = space();
    			ul5 = element("ul");
    			li27 = element("li");
    			t553 = text("As youll see on ");
    			strong109 = element("strong");
    			strong109.textContent = "page XX";
    			t555 = text(", with 1-point boxes you may mark as many of them as you want when you get hit (the escalating-value style of Fate Core, meanwhile, has a you can only mark one box per hit proviso).");
    			t556 = space();
    			li28 = element("li");
    			t557 = text("This style goes with the Fate Core notion of separate Physical and Mental stress tracks, instead of a single unified track as with Fate Accelerated. If youre inclined towards a unified track, add three more boxes to make up for it, and use the ");
    			em15 = element("em");
    			em15.textContent = "higher";
    			t559 = text(" of Physique or Will to lengthen it as indicated.");
    			t560 = space();
    			li29 = element("li");
    			t561 = text("Three points of stress absorption on one track is not a lot! If characters end up feeling a little fragile in play, you may want to add one or two boxes to the default quantity. Its all about how fast the consequences hit. (With the older style, a ");
    			strong110 = element("strong");
    			strong110.textContent = "[1][2]";
    			t563 = text(" track absorbs 2 to 3 stress, ");
    			strong111 = element("strong");
    			strong111.textContent = "[1][2][3]";
    			t565 = text(" = 3 to 6, ");
    			strong112 = element("strong");
    			strong112.textContent = "[1][2][3][4]";
    			t567 = text(" = 4 to 10.)");
    			t568 = space();
    			h37 = element("h3");
    			h37.textContent = "Finishing Touches";
    			t570 = space();
    			p113 = element("p");
    			p113.textContent = "Give your character a name and description, and discuss their history with the other players. If you havent written down a relationship aspect yet, do so now.";
    			t572 = space();
    			h14 = element("h1");
    			h14.textContent = "Taking Action, Rolling the Dice";
    			t574 = space();
    			hr7 = element("hr");
    			t575 = space();
    			p114 = element("p");
    			t576 = text("In a game of ");
    			em16 = element("em");
    			em16.textContent = "Fate Condensed";
    			t578 = text(", you will control the actions of the character you created, contributing to the story you are all telling together. In general, the GM will narrate the world and the actions of non-player characters (");
    			strong113 = element("strong");
    			strong113.textContent = "NPCs";
    			t580 = text("), and the other players will narrate their individual PCs actions.");
    			t581 = space();
    			p115 = element("p");
    			t582 = text("To act, follow the principle of ");
    			strong114 = element("strong");
    			strong114.textContent = "fiction first";
    			t584 = text(": say what your character is trying to do, ");
    			em17 = element("em");
    			em17.textContent = "then";
    			t586 = text(" figure out how youll do that in the system. Your characters aspects inform what they can attempt and help set the context for interpreting the results. Most people couldnt even try to perform emergency surgery on a disemboweled ally, but with an aspect establishing a medical background, you can try. Without that aspect you might at best buy a few moments for some last words. When in doubt, check with your GM and the table.");
    			t587 = space();
    			p116 = element("p");
    			p116.textContent = "How do you know if youre successful? Often, your character will simply succeed, because the action isnt hard and nobodys trying to stop you. But in difficult or unpredictable situations, youll break out the dice to find out what happens.";
    			t589 = space();
    			p117 = element("p");
    			p117.textContent = "When a character wants to take an action, the group should think about these questions:";
    			t591 = space();
    			ul6 = element("ul");
    			li30 = element("li");
    			li30.textContent = "Whats stopping this from happening?";
    			t593 = space();
    			li31 = element("li");
    			li31.textContent = "What could go wrong?";
    			t595 = space();
    			li32 = element("li");
    			li32.textContent = "How is it interesting when it does go wrong?";
    			t597 = space();
    			p118 = element("p");
    			p118.textContent = "If no one has good answers to all of these questions, it simply happens. Driving to the airport doesnt require a roll of the dice. Racing down the highway to a waiting plane while being pursued by cybernetically enhanced beasts from another world, on the other hand, is a perfect time to roll the dice.";
    			t599 = space();
    			p119 = element("p");
    			p119.textContent = "Whenever you take action, follow these steps:";
    			t601 = space();
    			ol = element("ol");
    			li33 = element("li");
    			t602 = text("Fiction first: Describe what youre trying to do, ");
    			em18 = element("em");
    			em18.textContent = "then";
    			t604 = text(" choose the skill and action that fits.");
    			t605 = space();
    			li34 = element("li");
    			li34.textContent = "Roll four dice.";
    			t607 = space();
    			li35 = element("li");
    			li35.textContent = "Add up the symbols on the dice: a [+] is +1, [-] is -1, and [0] is 0. This will give you a dice result of -4 to 4.";
    			t609 = space();
    			li36 = element("li");
    			li36.textContent = "Add the dice result to your skill rating.";
    			t611 = space();
    			li37 = element("li");
    			t612 = text("Modify the dice by invoking aspects (");
    			strong115 = element("strong");
    			strong115.textContent = "page XX";
    			t614 = text(") and using stunts (");
    			strong116 = element("strong");
    			strong116.textContent = "page XX";
    			t616 = text(").");
    			t617 = space();
    			li38 = element("li");
    			t618 = text("Declare your total result, called your ");
    			strong117 = element("strong");
    			strong117.textContent = "effort";
    			t620 = text(".");
    			t621 = space();
    			h23 = element("h2");
    			h23.textContent = "Difficulty and Opposition";
    			t623 = space();
    			hr8 = element("hr");
    			t624 = space();
    			p120 = element("p");
    			t625 = text("If the characters action faces a fixed obstacle or otherwise tries to alter the world rather than a character or creature, their action faces a static ");
    			strong118 = element("strong");
    			strong118.textContent = "difficulty";
    			t627 = text(" rating. These actions include picking locks, barring doors, and tactically assessing an enemy camp. The GM may decide that the presence of certain aspects (on the character, the scene, or something else) justifies changing the difficulty.");
    			t628 = space();
    			p121 = element("p");
    			t629 = text("At other times, an enemy will provide ");
    			strong119 = element("strong");
    			strong119.textContent = "opposition";
    			t631 = text(" against the characters action by using a defend action (");
    			strong120 = element("strong");
    			strong120.textContent = "page XX";
    			t633 = text("). In these cases, the GM will also roll the dice and follow the same rules as in the previous section, using any skills, stunts, or aspects the enemy has. Any time you roll to attack an enemy or to create an advantage directly against them, the enemy will roll to defend against it.");
    			t634 = space();
    			p122 = element("p");
    			t635 = text("Opposition can take many forms. Struggling with a cultist over the ritual dagger has a clear opponent. Or you might be opposed by the power of an ancient ritual that must be overcome to save the world. Cracking the safe in the First Metropolitan Bank to access the safe deposit boxes is a challenge with risk of discovery, but its up to the GM if youre rolling against ");
    			em19 = element("em");
    			em19.textContent = "opposition";
    			t637 = text(" from the patrolling guards or the ");
    			em20 = element("em");
    			em20.textContent = "difficulty";
    			t639 = text(" presented by the safe itself.");
    			t640 = space();
    			h24 = element("h2");
    			h24.textContent = "Modifying the Dice";
    			t642 = space();
    			hr9 = element("hr");
    			t643 = space();
    			p123 = element("p");
    			t644 = text("You may modify your dice by invoking aspects to get +2 to your roll or reroll the dice. Some stunts also give you a bonus. You may also invoke aspects to support an ally (");
    			strong121 = element("strong");
    			strong121.textContent = "page XX";
    			t646 = text(") or to increase the difficulty an enemy faces.");
    			t647 = space();
    			h38 = element("h3");
    			h38.textContent = "Invoking Aspects";
    			t649 = space();
    			p124 = element("p");
    			p124.textContent = "When you take action but the dice come up short, you dont have to sit back and accept failure. (Though you totally can. Thats fun too.) The aspects in play give you options and opportunity to succeed.";
    			t651 = space();
    			p125 = element("p");
    			t652 = text("When an aspect could justifiably help your efforts, describe how it helps and spend a fate point to ");
    			strong122 = element("strong");
    			strong122.textContent = "invoke";
    			t654 = text(" it (or use a free invoke). What is and isnt justifiable is subject to the ");
    			strong123 = element("strong");
    			strong123.textContent = "bogus rule";
    			t656 = text("  anyone can say thats bogus! to invoking an aspect. Simply put, the bogus rule is a ");
    			strong124 = element("strong");
    			strong124.textContent = "calibration tool";
    			t658 = text(" that anyone at the table may use to help the group make sure the game stays true to its vision and concept. You can use the safety tools discussed on ");
    			strong125 = element("strong");
    			strong125.textContent = "page XX";
    			t660 = text(" in a similar fashion.");
    			t661 = space();
    			p126 = element("p");
    			t662 = text("You have two options when your invoke looks bogus. First, you can retract your invoke and try something else, maybe a different aspect. Second, you can have a quick discussion about why you think the aspect fits. If the person still isnt convinced, retract the invoke and move on. If they come around to your perspective, go ahead with the invoke as usual. The bogus rule is in here to help everyone at the table have a good time. Use it when something doesnt sound right, make sense, or fit the tone. Someone invoking ");
    			strong126 = element("strong");
    			strong126.textContent = "Great at First Impressions";
    			t664 = text(" to throw a car is likely bogus. Butmaybethatcharacter has a supernatural stunt that makes them incredibly strong, strong enough to plausibly throw a car, and this is their opening gambit in a fight with a horrible monster. In that case, maybe ");
    			strong127 = element("strong");
    			strong127.textContent = "Great at First Impressions";
    			t666 = text(" is plausible.");
    			t667 = space();
    			p127 = element("p");
    			t668 = text("When you invoke an aspect, you can either ");
    			strong128 = element("strong");
    			strong128.textContent = "gain a +2 bonus";
    			t670 = text(" to your roll or ");
    			strong129 = element("strong");
    			strong129.textContent = "reroll all four dice";
    			t672 = text(", or you can add 2 to the difficulty of someone elses roll, if justifiable. You can invoke multiple aspects on the same roll, but you cant invoke the same aspect multiple times on the same roll. There is one exception: you can spend as many ");
    			em21 = element("em");
    			em21.textContent = "free invokes";
    			t674 = text(" on an aspect as you like on the same roll.");
    			t675 = space();
    			p128 = element("p");
    			t676 = text("Often youll invoke one of your character aspects. You may also invoke a situation aspect or make a hostile invocation of another characters aspect (");
    			strong130 = element("strong");
    			strong130.textContent = "page XX";
    			t678 = text(").");
    			t679 = space();
    			h39 = element("h3");
    			h39.textContent = "Using Stunts";
    			t681 = space();
    			p129 = element("p");
    			t682 = text("Stunts may give you a bonus to your roll, provided you meet the criteria written in the stunt, such as the circumstances, action, or skill used. You may wish to use create advantage (");
    			strong131 = element("strong");
    			strong131.textContent = "page XX";
    			t684 = text(") to introduce aspects that line up with those circumstances. Keep your stunts circumstances in mind when you describe your actions too, and set yourself up for success.");
    			t685 = space();
    			p130 = element("p");
    			p130.textContent = "Normally, stunts give you a +2 bonus in a narrow circumstance with no cost; you may use them anytime they apply. Some rare and exceptionally powerful stunts may require you to spend a fate point to use them.";
    			t687 = space();
    			h25 = element("h2");
    			h25.textContent = "Outcomes";
    			t689 = space();
    			hr10 = element("hr");
    			t690 = space();
    			p131 = element("p");
    			t691 = text("Whenever you roll dice, the difference between your effort and the target difficulty or opposition is measured in ");
    			strong132 = element("strong");
    			strong132.textContent = "shifts";
    			t693 = text(". A shift has a value of 1. There are four possible outcomes:");
    			t694 = space();
    			ul7 = element("ul");
    			li39 = element("li");
    			t695 = text("If your effort is less than the target difficulty or opposition, you ");
    			strong133 = element("strong");
    			strong133.textContent = "fail";
    			t697 = text(".");
    			t698 = space();
    			li40 = element("li");
    			t699 = text("If your effort is equal to the target, you ");
    			strong134 = element("strong");
    			strong134.textContent = "tie";
    			t701 = text(".");
    			t702 = space();
    			li41 = element("li");
    			t703 = text("If your effort is one or two shifts more than the target, you ");
    			strong135 = element("strong");
    			strong135.textContent = "succeed";
    			t705 = text(".");
    			t706 = space();
    			li42 = element("li");
    			t707 = text("If your effort is three or more shifts more than the target, you ");
    			strong136 = element("strong");
    			strong136.textContent = "succeed with style";
    			t709 = text(".");
    			t710 = space();
    			p132 = element("p");
    			t711 = text("Some outcomes are obviously better for you than others, but all of them should advance the story in interesting ways. You started with fiction first (");
    			strong137 = element("strong");
    			strong137.textContent = "page XX";
    			t713 = text("); make sure you end with it too, to maintain focus on the story, and to ensure you interpret the results in a way that fits the fiction.");
    			t714 = space();
    			p133 = element("p");
    			p133.textContent = "Ethan isnt an adept safe-cracker (though he has the tools), and yet hes in a sinister cults guarded secret headquarters, with a steel door between him and the ritual book he desperately needs. Can he get in?";
    			t716 = space();
    			h310 = element("h3");
    			h310.textContent = "Failure";
    			t718 = space();
    			p134 = element("p");
    			p134.textContent = "If your effort is less than the target difficulty or opposition, you fail.";
    			t720 = space();
    			p135 = element("p");
    			p135.textContent = "This can play out in a few ways: simple failure, success at a major cost, or taking a hit.";
    			t722 = space();
    			h49 = element("h4");
    			h49.textContent = "Simple Failure";
    			t724 = space();
    			p136 = element("p");
    			t725 = text("The first is the easiest to understand");
    			strong138 = element("strong");
    			strong138.textContent = "simple failure";
    			t727 = text(". You dont accomplish your goal, dont make any progress, and are left wanting. Ensure this keeps the story movingsimply failing to crack the safe is stagnant and boring.");
    			t728 = space();
    			p137 = element("p");
    			p137.textContent = "Ethan pulls the handle triumphantly, but the safe remains resolutely closed while the alarms begin to blare. Failure has changed the situation and driven the story forwardnow there are guards on the way. Ethan is faced with a new choicetry another way of opening the safe, now that subtlety is out the window, or cut his losses and run?";
    			t730 = space();
    			h410 = element("h4");
    			h410.textContent = "Success at a major cost";
    			t732 = space();
    			p138 = element("p");
    			t733 = text("Second is ");
    			strong139 = element("strong");
    			strong139.textContent = "success at a major cost";
    			t735 = text(". You do what you set out to do, but theres a significant price to be paidthe situation gets worse or more complicated. GM, you can either declare this is the result or can offer it in place of failure. Both options are good and useful in different situations.");
    			t736 = space();
    			p139 = element("p");
    			p139.textContent = "Ethan fails his roll and the GM says, You hear the click of the last tumbler falling into place. Its echoed by the click of the hammer on a revolver as the guard tells you to put your hands in the air. The major cost here is the confrontation with a guard hed hoped to avoid.";
    			t738 = space();
    			h411 = element("h4");
    			h411.textContent = "Take a Hit";
    			t740 = space();
    			p140 = element("p");
    			t741 = text("Lastly, you may ");
    			strong140 = element("strong");
    			strong140.textContent = "take a hit";
    			t743 = text(", which youll need to absorb with stress or consequences, or suffer some other drawback. This sort of failure is most common when defending against attacks or overcoming dangerous obstacles. This is different from a simple failure because the character alone, not necessarily the whole group, is affected. Its also different from success at a major cost, in that success isnt necessarily on the table.");
    			t744 = space();
    			p141 = element("p");
    			t745 = text("Ethan is able to get the safe door open, but as he grasps the handle, he feels a jab in the back of his hand. He couldnt disable the trap! He writes down the mild consequence ");
    			strong141 = element("strong");
    			strong141.textContent = "Poisoned";
    			t747 = text(".");
    			t748 = space();
    			p142 = element("p");
    			p142.textContent = "You can mix these options together: Harmful failure can be harsh but appropriate in the moment. Success at the cost of harm is certainly an option.";
    			t750 = space();
    			h311 = element("h3");
    			h311.textContent = "Tie";
    			t752 = space();
    			p143 = element("p");
    			p143.textContent = "If your effort is equal to the target difficulty or opposition, you tie.";
    			t754 = space();
    			p144 = element("p");
    			p144.textContent = "Just like failure, ties should move the story forward, never stymie the action. Something interesting should happen. Similar to failure, this can play out a couple ways: success at a minor cost, or partial success.";
    			t756 = space();
    			h412 = element("h4");
    			h412.textContent = "Success at a minor cost";
    			t758 = space();
    			p145 = element("p");
    			t759 = text("The first is ");
    			strong142 = element("strong");
    			strong142.textContent = "success at a minor cost";
    			t761 = text("  a few points of stress, story details about difficulty or complication but arent hindrances themselves, and a boost (");
    			strong143 = element("strong");
    			strong143.textContent = "page XX";
    			t763 = text(") to the enemy are all minor costs.");
    			t764 = space();
    			p146 = element("p");
    			p146.textContent = "Ethans first few attempts all fail. By the time he actually gets the door open, dawn has broken, and escape under cover of darkness is impossible. He got what he needed, but his situation is worse now.";
    			t766 = space();
    			h413 = element("h4");
    			h413.textContent = "Partial Success";
    			t768 = space();
    			p147 = element("p");
    			t769 = text("The other way to handle a tie is ");
    			strong144 = element("strong");
    			strong144.textContent = "partial success";
    			t771 = text("  you succeeded but only got some of what you wanted.");
    			t772 = space();
    			p148 = element("p");
    			p148.textContent = "Ethan can only open the safe door a crackif the door opens more than an inch, the alarm will sound, and he cant figure out how to disengage that. He manages to pull a couple pages of the ritual out through the narrow gap, but hell have to guess at the final steps.";
    			t774 = space();
    			h312 = element("h3");
    			h312.textContent = "Success";
    			t776 = space();
    			p149 = element("p");
    			p149.textContent = "If your effort is one or two more than the target, you succeed.";
    			t778 = space();
    			p150 = element("p");
    			p150.textContent = "You get what you want with no additional cost.";
    			t780 = space();
    			p151 = element("p");
    			p151.textContent = "Opened! Ethan grabs the ritual and leaves before the guards notice him.";
    			t782 = space();
    			h414 = element("h4");
    			h414.textContent = "Applying Fiction First to Success";
    			t784 = space();
    			p152 = element("p");
    			t785 = text("The fiction ");
    			em22 = element("em");
    			em22.textContent = "defines";
    			t787 = text(" what success looks like. What if Ethan didnt have the tools or experience needed to break into the safe? Perhaps that success is more like our minor cost example above. Similarly, if Ethan was on the team because he ");
    			em23 = element("em");
    			em23.textContent = "built";
    			t789 = text(" the safe, that success might look more like our with style example.");
    			t790 = space();
    			h313 = element("h3");
    			h313.textContent = "Success with Style";
    			t792 = space();
    			p153 = element("p");
    			p153.textContent = "If your effort is three or more than the target, you succeed with style.";
    			t794 = space();
    			p154 = element("p");
    			p154.textContent = "You get what you want, and you get a bit more on top of that.";
    			t796 = space();
    			p155 = element("p");
    			p155.textContent = "Ethan is beyond lucky; the safe door opens almost instantly. Not only does he get the ritual, but he has enough time to poke through the other papers in the back of the safe. Amidst various ledgers and financial documents, he finds a map of the old Akeley mansion.";
    			t798 = space();
    			h26 = element("h2");
    			h26.textContent = "Actions";
    			t800 = space();
    			hr11 = element("hr");
    			t801 = space();
    			p156 = element("p");
    			p156.textContent = "There are four actions you can roll, each with a specific purpose and effect on the story:";
    			t803 = space();
    			ul8 = element("ul");
    			li43 = element("li");
    			strong145 = element("strong");
    			strong145.textContent = "Overcome";
    			t805 = text(" to surmount obstacles with your skills.");
    			t806 = space();
    			li44 = element("li");
    			strong146 = element("strong");
    			strong146.textContent = "Create an advantage";
    			t808 = text(" to change a situation to your benefit.");
    			t809 = space();
    			li45 = element("li");
    			strong147 = element("strong");
    			strong147.textContent = "Attack";
    			t811 = text(" to harm the enemy.");
    			t812 = space();
    			li46 = element("li");
    			strong148 = element("strong");
    			strong148.textContent = "Defend";
    			t814 = text(" to survive an attack, stop a foe from creating an advantage, or oppose an effort to overcome an obstacle.");
    			t815 = space();
    			h314 = element("h3");
    			h314.textContent = "Overcome";
    			t817 = space();
    			p157 = element("p");
    			p157.textContent = "Overcome to surmount obstacles with your skills.";
    			t819 = space();
    			p158 = element("p");
    			t820 = text("Every character will face untold challenges in the course of the story. The ");
    			strong149 = element("strong");
    			strong149.textContent = "overcome";
    			t822 = text(" action is how they face and surmount those obstacles.");
    			t823 = space();
    			p159 = element("p");
    			p159.textContent = "A character good at Athletics can climb over walls and race through crowded streets. A detective with high Investigate can piece together clues others have missed. Someone skilled in Rapport will find it easier to avoid a fight in a hostile bar.";
    			t825 = space();
    			p160 = element("p");
    			p160.textContent = "Your outcomes when overcoming are:";
    			t827 = space();
    			ul9 = element("ul");
    			li47 = element("li");
    			p161 = element("p");
    			strong150 = element("strong");
    			strong150.textContent = "If you fail,";
    			t829 = text(" discuss with the GM (and the defending player, if any) whether its a failure or success at a major cost (");
    			strong151 = element("strong");
    			strong151.textContent = "page XX";
    			t831 = text(").");
    			t832 = space();
    			li48 = element("li");
    			p162 = element("p");
    			strong152 = element("strong");
    			strong152.textContent = "If you tie,";
    			t834 = text(" its success at a minor cost (");
    			strong153 = element("strong");
    			strong153.textContent = "page XX";
    			t836 = text(")youre in a tough spot, the enemy gets a boost (");
    			strong154 = element("strong");
    			strong154.textContent = "page XX";
    			t838 = text("), or you may take a hit. Alternatively, you fail but gain a boost.");
    			t839 = space();
    			li49 = element("li");
    			p163 = element("p");
    			strong155 = element("strong");
    			strong155.textContent = "If you succeed,";
    			t841 = text(" you meet your goal and the story moves on without hiccups.");
    			t842 = space();
    			li50 = element("li");
    			p164 = element("p");
    			strong156 = element("strong");
    			strong156.textContent = "If you succeed with style,";
    			t844 = text(" its a success and you also get a boost.");
    			t845 = space();
    			p165 = element("p");
    			p165.textContent = "Charles has made his way to an Antarctic research facility. The buildings have been wrecked, and the occupants are missing. He wants to search the wreckage for clues. The GM tells him to roll Investigate against Fair(+2) difficulty. Charles gets [0][0][+][+] on the dice, plus his Average(+1) Investigate, for a Good(+3) effort. A success! The GM describes the clue he finds: footprints in the snow, made by creatures walking on many thin, inhuman legs.";
    			t847 = space();
    			p166 = element("p");
    			p166.textContent = "Overcome actions are often used to determine whether a character can access or notice a particular fact or clue. Keep a close eye on those success-at-a-cost options when thats the case. If missing a detail would cause your story to stall, take failure off the table, and focus on the cost instead.";
    			t849 = space();
    			h315 = element("h3");
    			h315.textContent = "Create an Advantage";
    			t851 = space();
    			p167 = element("p");
    			p167.textContent = "Create A situation aspect or gain a benefit from an existing aspect.";
    			t853 = space();
    			p168 = element("p");
    			t854 = text("You can use the ");
    			strong157 = element("strong");
    			strong157.textContent = "create an advantage";
    			t856 = text(" action to change the course of the story. By using your skills to introduce new aspects or add invokes to existing aspects, you can stack the deck for yourself and your teammates. You might change the circumstances (barring a door or creating a plan), discover new information (learning a monsters weakness through research), or take advantage of something already known (such as a CEOs taste for scotch).");
    			t857 = space();
    			p169 = element("p");
    			t858 = text("An aspect created (or discovered) by creating an advantage works like any other: It defines the narrative circumstances and can allow, prevent, or impede actionsfor instance, you cannot read a spell if the room has been made ");
    			strong158 = element("strong");
    			strong158.textContent = "Pitch Black";
    			t860 = text(". It can also be invoked (");
    			strong159 = element("strong");
    			strong159.textContent = "page XX";
    			t862 = text(") or compelled (");
    			strong160 = element("strong");
    			strong160.textContent = "page XX";
    			t864 = text("). In addition, creating an advantage gives you one or more ");
    			strong161 = element("strong");
    			strong161.textContent = "free invokes";
    			t866 = text(" of the created aspect. A free invoke, as the name suggests, lets you invoke an aspect without spending a fate point. You can even let your allies use free invokes you have created.");
    			t867 = space();
    			p170 = element("p");
    			p170.textContent = "When you roll to create an advantage, specify whether youre creating a new aspect or taking advantage of an existing one. If the former, are you attaching the aspect to an ally, opponent, or the environment? If youre attaching it to an opponent, they can take the defend action to oppose you. Otherwise youll usually face a difficulty, but the GM can decide if something or someone opposes your efforts with a defend roll instead.";
    			t869 = space();
    			p171 = element("p");
    			p171.textContent = "Your outcomes when creating a new aspect are:";
    			t871 = space();
    			ul10 = element("ul");
    			li51 = element("li");
    			p172 = element("p");
    			strong162 = element("strong");
    			strong162.textContent = "If you fail,";
    			t873 = text(" you either dont create the aspect (failure) or you create it but the enemy gets the free invoke (success at a cost). If you succeed at a cost, the final aspect may need to be rewritten to benefit the enemy. This may still be worth it because aspects are true (");
    			strong163 = element("strong");
    			strong163.textContent = "page XX";
    			t875 = text(").");
    			t876 = space();
    			li52 = element("li");
    			p173 = element("p");
    			strong164 = element("strong");
    			strong164.textContent = "If you tie,";
    			t878 = text(" you dont create an aspect, but you do get a boost (");
    			strong165 = element("strong");
    			strong165.textContent = "page XX";
    			t880 = text(").");
    			t881 = space();
    			li53 = element("li");
    			p174 = element("p");
    			strong166 = element("strong");
    			strong166.textContent = "If you succeed,";
    			t883 = text(" you create a situation aspect with one free invoke on it.");
    			t884 = space();
    			li54 = element("li");
    			p175 = element("p");
    			strong167 = element("strong");
    			strong167.textContent = "If you succeed with style,";
    			t886 = text(" you create a situation aspect with ");
    			em24 = element("em");
    			em24.textContent = "two";
    			t888 = text(" free invokes on it.");
    			t889 = space();
    			p176 = element("p");
    			p176.textContent = "With an existing known or unknown aspect the outcomes are:";
    			t891 = space();
    			ul11 = element("ul");
    			li55 = element("li");
    			p177 = element("p");
    			strong168 = element("strong");
    			strong168.textContent = "If you fail,";
    			t893 = text(" and the aspect was known, the enemy gets a free invoke. If it was unknown, they may choose to reveal it to get a free invoke.");
    			t894 = space();
    			li56 = element("li");
    			p178 = element("p");
    			strong169 = element("strong");
    			strong169.textContent = "If you tie,";
    			t896 = text(" you gain a boost if the aspect was unknown; it stays unknown. If the aspect is known, you get a free invoke on it instead.");
    			t897 = space();
    			li57 = element("li");
    			p179 = element("p");
    			strong170 = element("strong");
    			strong170.textContent = "If you succeed,";
    			t899 = text(" gain a free invoke on the aspect, revealing it if unknown.");
    			t900 = space();
    			li58 = element("li");
    			p180 = element("p");
    			strong171 = element("strong");
    			strong171.textContent = "If you succeed with style,";
    			t902 = text(" gain two free invokes, revealing it if unknown.");
    			t903 = space();
    			p181 = element("p");
    			p181.textContent = "Ethan is face-to-something with a shoggoth, a massive and tireless fleshy beast. He knows its too powerful to attack directly, so he decides his best bet is to distract it: Id like to make a Molotov cocktail and set this thing on fire! he announces.";
    			t905 = space();
    			p182 = element("p");
    			p182.textContent = "The GM decides that actually hitting the shoggoth is trivial, so this is a Crafts rollhow quickly can he find and weaponize something flammable? The difficulty is set at Good(+3). Ethan has Average(+1) Crafts but rolls [0][+][+][+], giving a Great(+4) effort.";
    			t907 = space();
    			p183 = element("p");
    			t908 = text("Ethan cobbles together the Molotov and tosses it at the beast. The shoggoth is now ");
    			strong172 = element("strong");
    			strong172.textContent = "On Fire";
    			t910 = text(", and Ethan has one free invoke on that aspect. The shoggoth is definitely distracted, and if it does try to chase him, Ethan can use that invoke to help himself get away.");
    			t911 = space();
    			h316 = element("h3");
    			h316.textContent = "Attack";
    			t913 = space();
    			p184 = element("p");
    			p184.textContent = "Attack to harm the enemy.";
    			t915 = space();
    			p185 = element("p");
    			t916 = text("The ");
    			strong173 = element("strong");
    			strong173.textContent = "attack";
    			t918 = text(" action is how you try to take out an opponentwhether youre looking to kill a loathsome monster, or knock out an innocent guard who doesnt know the truth about what hes guarding. An attack can be unloading with a machine gun, throwing a solid punch, or casting a baleful spell.");
    			t919 = space();
    			p186 = element("p");
    			p186.textContent = "Keep in mind whether or not harming your target is even possible. Not every attack is equal. You cant just punch a kaiju and hope to hurt it. Determine whether the attack even has a chance of being successful before you start rolling the dice. A number of powerful beings may have specific weaknesses that need to be exploited, or some means of defense you must get through before you can even begin to hurt them.";
    			t921 = space();
    			p187 = element("p");
    			p187.textContent = "Your outcomes when attacking are:";
    			t923 = space();
    			ul12 = element("ul");
    			li59 = element("li");
    			p188 = element("p");
    			strong174 = element("strong");
    			strong174.textContent = "If you fail,";
    			t925 = text(" you fail to connectthe attack is parried, dodged, or maybe just absorbed by armor.");
    			t926 = space();
    			li60 = element("li");
    			p189 = element("p");
    			strong175 = element("strong");
    			strong175.textContent = "If you tie,";
    			t928 = text(" maybe you barely connect, maybe you cause the defender to flinch. Either way, you get a boost (");
    			strong176 = element("strong");
    			strong176.textContent = "page XX";
    			t930 = text(").");
    			t931 = space();
    			li61 = element("li");
    			p190 = element("p");
    			strong177 = element("strong");
    			strong177.textContent = "If you succeed,";
    			t933 = text(" you deal a hit equal to the difference between your attacks total and the defenses effort. The defender must absorb this hit with stress or consequences, or else be taken out (");
    			strong178 = element("strong");
    			strong178.textContent = "page XX";
    			t935 = text(").");
    			t936 = space();
    			li62 = element("li");
    			p191 = element("p");
    			strong179 = element("strong");
    			strong179.textContent = "If you succeed with style,";
    			t938 = text(" you deal a hit just like a success, but you may reduce the shifts of the hit by one to get a boost.");
    			t939 = space();
    			p192 = element("p");
    			p192.textContent = "Ruth has stumbled across a corpse raised by arcane powers to fulfill some dark purpose. She decides to punch it. She has Great(+4) Fight but rolls [-][-][0][0], giving a Fair(+2) effort.";
    			t941 = space();
    			h317 = element("h3");
    			h317.textContent = "Defend";
    			t943 = space();
    			p193 = element("p");
    			p193.textContent = "Defend to survive an attack or interfere with a foes action.";
    			t945 = space();
    			p194 = element("p");
    			t946 = text("Is a monster trying to eat your face? Is a foe pushing you out of the way as they flee your wrath? What about when that cultist tries to stab you in both kidneys? ");
    			strong180 = element("strong");
    			strong180.textContent = "Defend";
    			t948 = text(", defend, defend.");
    			t949 = space();
    			p195 = element("p");
    			t950 = text("Defend is the only reactive action in ");
    			em25 = element("em");
    			em25.textContent = "Fate Condensed";
    			t952 = text(". You use it to stop something from happening outside your turn, so youre often facing an opposing roll rather than a set difficulty. Your enemy rolls, and you immediately roll to defend, so long as youre the target or can justify your opposition (which often makes you the target). Aspects or stunts may provide justification.");
    			t953 = space();
    			p196 = element("p");
    			p196.textContent = "Your outcomes when defending are:";
    			t955 = space();
    			ul13 = element("ul");
    			li63 = element("li");
    			p197 = element("p");
    			strong181 = element("strong");
    			strong181.textContent = "If you fail";
    			t957 = text(" against an attack, you take a hit, which you must absorb with stress (");
    			strong182 = element("strong");
    			strong182.textContent = "page XX";
    			t959 = text(") or consequences (");
    			strong183 = element("strong");
    			strong183.textContent = "page XX";
    			t961 = text("). Regardless, the enemy succeeds as described for their action.");
    			t962 = space();
    			li64 = element("li");
    			p198 = element("p");
    			strong184 = element("strong");
    			strong184.textContent = "If you tie,";
    			t964 = text(" proceed according to the tie result for the opposed action.");
    			t965 = space();
    			li65 = element("li");
    			p199 = element("p");
    			strong185 = element("strong");
    			strong185.textContent = "If you succeed,";
    			t967 = text(" you dont take a hit or you deny the enemys action.");
    			t968 = space();
    			li66 = element("li");
    			p200 = element("p");
    			strong186 = element("strong");
    			strong186.textContent = "If you succeed with style,";
    			t970 = text(" you dont take a hit, you deny the enemys action, and you even get a boost as you gain the upper hand for a moment.");
    			t971 = space();
    			p201 = element("p");
    			p201.textContent = "Continuing from the previous example, the corpse gets to defend itself against Ruth. The GM rolls [-][0][0][+], which doesnt change the creatures Mediocre(+0) Athletics.";
    			t973 = space();
    			p202 = element("p");
    			p202.textContent = "Because Ruths effort was higher, her attack succeeds by two shifts, and the corpse is a little closer to being down for good. Had the corpse rolled better, then its defense would have succeeded, and the undead monstrosity would have avoided taking a hit.";
    			t975 = space();
    			h415 = element("h4");
    			h415.textContent = "Which skills can be used to attack and defend?";
    			t977 = space();
    			p203 = element("p");
    			p203.textContent = "The default list of skills follows these guidelines:";
    			t979 = space();
    			ul14 = element("ul");
    			li67 = element("li");
    			li67.textContent = "Fight and Shoot can be used to make physical attacks.";
    			t981 = space();
    			li68 = element("li");
    			li68.textContent = "Athletics can be used to defend against any physical attack.";
    			t983 = space();
    			li69 = element("li");
    			li69.textContent = "Fight can be used to defend against melee physical attacks.";
    			t985 = space();
    			li70 = element("li");
    			li70.textContent = "Provoke can be used to make a mental attack.";
    			t987 = space();
    			li71 = element("li");
    			li71.textContent = "Will can be used to defend against mental attacks.";
    			t989 = space();
    			p204 = element("p");
    			p204.textContent = "Other skills may gain permission to attack or defend under special circumstances, as determined by the GM or table consensus. Some stunts may grant broader, guaranteed permission when circumstances might otherwise not do so. When a skill cant be used to attack or defend but might help with it, prepare for it by using that skill with the create an advantage action, and use the free invokes generated on your next attack or defend roll.";
    			t991 = space();
    			h15 = element("h1");
    			h15.textContent = "Aspects and Fate Points";
    			t993 = space();
    			hr12 = element("hr");
    			t994 = space();
    			p205 = element("p");
    			t995 = text("An ");
    			strong187 = element("strong");
    			strong187.textContent = "aspect";
    			t997 = text(" is a word or phrase that describes something special about a person, place, thing, situation, or group. Almost anything you can think of can have aspects. A person might have a reputation as the ");
    			strong188 = element("strong");
    			strong188.textContent = "Greatest Sharpshooter in the Wasteland";
    			t999 = text(" (see below for more about these kinds of aspects). A room might be ");
    			strong189 = element("strong");
    			strong189.textContent = "On Fire";
    			t1001 = text(" after you knock over an oil lamp. After an encounter with a monster, you might be ");
    			strong190 = element("strong");
    			strong190.textContent = "Terrified";
    			t1003 = text(". Aspects let you change the story in ways that go along with your characters tendencies, skills, or problems.");
    			t1004 = space();
    			h27 = element("h2");
    			h27.textContent = "Aspects Are Always True";
    			t1006 = space();
    			hr13 = element("hr");
    			t1007 = space();
    			p206 = element("p");
    			t1008 = text("You can invoke aspects for a bonus to a roll (");
    			strong191 = element("strong");
    			strong191.textContent = "page XX";
    			t1010 = text(") and compel them to create a complication (");
    			strong192 = element("strong");
    			strong192.textContent = "page XX";
    			t1012 = text("). But even when those arent in play, aspects still affect the narrative. When you have that flesh-wrapped monstrosity ");
    			strong193 = element("strong");
    			strong193.textContent = "Pinned in a Hydraulic Press";
    			t1014 = text(", that is ");
    			em26 = element("em");
    			em26.textContent = "true";
    			t1016 = text(". It cant do much stuck in there, and its not getting out easy.");
    			t1017 = space();
    			p207 = element("p");
    			t1018 = text("In essence, aspects are always true means that ");
    			strong194 = element("strong");
    			strong194.textContent = "aspects can grant or withdraw permission for what can happen in the story";
    			t1020 = text(" (they can also affect difficulty: see ");
    			strong195 = element("strong");
    			strong195.textContent = "page XX";
    			t1022 = text("). If the aforementioned monstrosity is ");
    			strong196 = element("strong");
    			strong196.textContent = "Pinned";
    			t1024 = text(", the GM (and everyone else) has to respect that. The creature has lost permission to move until something happens which removes that aspect, either a successful overcome (which itself might require a justifying aspect like ");
    			strong197 = element("strong");
    			strong197.textContent = "Superhuman Strength";
    			t1026 = text(") or someone foolishly reversing the press. Similarly, if you have ");
    			strong198 = element("strong");
    			strong198.textContent = "Cybernetically Enhanced Legs";
    			t1028 = text(", youve arguably gained permission to leap over walls in a single bound without even having to roll for it.");
    			t1029 = space();
    			p208 = element("p");
    			t1030 = text("Thats not to say you can create any aspect you want and use its truth like a club. Aspects grant a lot of power to shape the story, yes, but with that power comes the responsibility to play within the storys constraints. Aspects have to line up with the tables sense of what actually passes muster. ");
    			strong199 = element("strong");
    			strong199.textContent = "If an aspect doesnt pass the sniff test, it needs to be reworded.";
    			t1032 = space();
    			p209 = element("p");
    			t1033 = text("Sure, you might ");
    			em27 = element("em");
    			em27.textContent = "like";
    			t1035 = text(" to use create an advantage to inflict the aspect ");
    			strong200 = element("strong");
    			strong200.textContent = "Dismembered";
    			t1037 = text(" on that fungal super-soldier, but that clearly steps on the toes of the attack action, and besides, it takes a bit more work to lop her arm off than that (could work as a consequence, thoughsee the next page). You might ");
    			em28 = element("em");
    			em28.textContent = "say";
    			t1039 = text(" youre the ");
    			strong201 = element("strong");
    			strong201.textContent = "Worlds Best Shot";
    			t1041 = text(", but youll need to back that up with your skills. And as much as youd like to make yourself ");
    			strong202 = element("strong");
    			strong202.textContent = "Bulletproof";
    			t1043 = text(", removing permission for someone to use small arms fire to harm you, that is unlikely to fly unless the game youre playing involves using aspects-as-superpowers.");
    			t1044 = space();
    			h28 = element("h2");
    			h28.textContent = "What Kinds of Aspects Are There?";
    			t1046 = space();
    			hr14 = element("hr");
    			t1047 = space();
    			p210 = element("p");
    			t1048 = text("Theres an endless variety of aspects (see ");
    			strong203 = element("strong");
    			strong203.textContent = "page XX";
    			t1050 = text(" for more), but no matter what theyre called, they all work pretty much the same way. The main difference is how long they stick around before going away.");
    			t1051 = space();
    			h318 = element("h3");
    			h318.textContent = "Character Aspects";
    			t1053 = space();
    			p211 = element("p");
    			t1054 = text("These aspects are on your character sheet, such as your high concept and trouble. They describe personality traits, important details about your past, relationships you have with others, important items or titles you possess, problems youre dealing with or goals youre working toward, or reputations and obligations you carry. These aspects primarily change during milestones (");
    			strong204 = element("strong");
    			strong204.textContent = "page XX";
    			t1056 = text(").");
    			t1057 = space();
    			p212 = element("p");
    			strong205 = element("strong");
    			strong205.textContent = "Examples:";
    			t1059 = space();
    			strong206 = element("strong");
    			strong206.textContent = "Leader of My Band of Survivors; Attention to Detail; I Must Protect My Brother";
    			t1061 = space();
    			h319 = element("h3");
    			h319.textContent = "Situation Aspects";
    			t1063 = space();
    			p213 = element("p");
    			p213.textContent = "These aspects describe the surroundings or scenario where the action is taking place. A situation aspect usually vanishes at the end of the scene it was part of, or when someone takes some action that would change or get rid of it. Essentially, they last only as long as the situation they represent lasts.";
    			t1065 = space();
    			p214 = element("p");
    			strong207 = element("strong");
    			strong207.textContent = "Examples:";
    			t1067 = space();
    			strong208 = element("strong");
    			strong208.textContent = "On Fire; Bright Sunlight; Crowd of Angry People; Knocked to the Ground; Pursued by the Police";
    			t1069 = space();
    			h320 = element("h3");
    			h320.textContent = "Consequences";
    			t1071 = space();
    			p215 = element("p");
    			t1072 = text("These aspects represent injuries or other lasting trauma taken by absorbing a hit, often from attacks (");
    			strong209 = element("strong");
    			strong209.textContent = "page XX";
    			t1074 = text(").");
    			t1075 = space();
    			p216 = element("p");
    			strong210 = element("strong");
    			strong210.textContent = "Examples:";
    			t1077 = space();
    			strong211 = element("strong");
    			strong211.textContent = "Sprained Ankle; Concussion; Debilitating Self-Doubt";
    			t1079 = space();
    			h321 = element("h3");
    			h321.textContent = "Boosts";
    			t1081 = space();
    			p217 = element("p");
    			t1082 = text("A ");
    			strong212 = element("strong");
    			strong212.textContent = "boost";
    			t1084 = text(" is a special kind of aspect, representing an extremely temporary or minor situation. You cannot compel a boost or spend a fate point to invoke it. You may invoke it once for free, after which it vanishes. An unused boost vanishes when the advantage it represents no longer exists, which may be a few seconds or the duration of a single action. They never persist beyond the end of a scene, and you can hold off naming one until youre using it. If youre in control of a boost, you may pass it to an ally if theres rationale for it.");
    			t1085 = space();
    			p218 = element("p");
    			strong213 = element("strong");
    			strong213.textContent = "Examples:";
    			t1087 = space();
    			strong214 = element("strong");
    			strong214.textContent = "In My Sights; Distracted; Unstable Footing";
    			t1089 = space();
    			h29 = element("h2");
    			h29.textContent = "What Can I Do with Aspects?";
    			t1091 = space();
    			hr15 = element("hr");
    			t1092 = space();
    			h322 = element("h3");
    			h322.textContent = "Earning Fate Points";
    			t1094 = space();
    			p219 = element("p");
    			t1095 = text("One way you can earn fate points is by letting your characters aspects be ");
    			strong215 = element("strong");
    			strong215.textContent = "compelled";
    			t1097 = text(" (");
    			strong216 = element("strong");
    			strong216.textContent = "page XX";
    			t1099 = text(") against you to complicate the situation or make your life harder. You may also get a fate point payout if someone uses your aspect against you in a hostile invoke (");
    			strong217 = element("strong");
    			strong217.textContent = "page XX";
    			t1101 = text(") or when you concede (");
    			strong218 = element("strong");
    			strong218.textContent = "page XX";
    			t1103 = text(").");
    			t1104 = space();
    			p220 = element("p");
    			t1105 = text("Remember, each session, you also start with fate points at least equal to your ");
    			strong219 = element("strong");
    			strong219.textContent = "refresh";
    			t1107 = text(". If you were compelled more than you invoked in the prior session, youll show up at the next one with more. See ");
    			strong220 = element("strong");
    			strong220.textContent = "page XX";
    			t1109 = text(" for details.");
    			t1110 = space();
    			h323 = element("h3");
    			h323.textContent = "Invokes";
    			t1112 = space();
    			p221 = element("p");
    			t1113 = text("To unlock the true power of aspects and make them help you, youll need to spend ");
    			strong221 = element("strong");
    			strong221.textContent = "fate points";
    			t1115 = text(" to ");
    			strong222 = element("strong");
    			strong222.textContent = "invoke";
    			t1117 = text(" them during dice rolls (");
    			strong223 = element("strong");
    			strong223.textContent = "page XX";
    			t1119 = text("). Keep track of your fate points with pennies or glass beads or poker chips or some other tokens.");
    			t1120 = space();
    			p222 = element("p");
    			t1121 = text("You can also invoke aspects for free, ");
    			em29 = element("em");
    			em29.textContent = "if";
    			t1123 = text(" you have a free invoke from you or an ally creating an advantage you can use (");
    			strong224 = element("strong");
    			strong224.textContent = "page XX";
    			t1125 = text(").");
    			t1126 = space();
    			h416 = element("h4");
    			h416.textContent = "The Ellipsis Trick";
    			t1128 = space();
    			p223 = element("p");
    			p223.textContent = "If you want an easy way to ensure you have room to incorporate aspects into a roll, try narrating your action with an ellipsis at the end (...), and then finish the action with the aspect you want to invoke. Like this:";
    			t1130 = space();
    			p224 = element("p");
    			t1131 = text("Ryan says, So Im trying to decipher the runes and... (rolls the dice, hates the result) ...and ");
    			strong225 = element("strong");
    			strong225.textContent = "If I Havent Been There, Ive Read About It";
    			t1133 = text("... (spends a fate point) ...so I easily start rambling about their origin.");
    			t1134 = space();
    			h417 = element("h4");
    			h417.textContent = "Hostile Invocations";
    			t1136 = space();
    			p225 = element("p");
    			t1137 = text("Most of the time an aspect is invoked, its a character aspect or a situation aspect. Sometimes youll invoke enemies character aspects ");
    			em30 = element("em");
    			em30.textContent = "against";
    			t1139 = text(" them. This is called a ");
    			strong226 = element("strong");
    			strong226.textContent = "hostile invocation";
    			t1141 = text(", and it works just like invoking any other aspectpay a fate point and get a +2 to your roll or reroll the dice. Theres one small difference");
    			strong227 = element("strong");
    			strong227.textContent = "when you make a hostile invocation, you give the fate point to the enemy.";
    			t1143 = text(" But they dont get to use the fate point until after the scene is over. This payout only applies when a fate point is actually spent on a hostile invocation. Free invokes do not trigger a payout.");
    			t1144 = space();
    			h418 = element("h4");
    			h418.textContent = "Invoking to Declare Story Details";
    			t1146 = space();
    			p226 = element("p");
    			t1147 = text("You may add an important or unlikely detail to the story based on an aspect in play. Dont spend a fate point when aspects are always true (");
    			strong228 = element("strong");
    			strong228.textContent = "pageXX";
    			t1149 = text(") applies. Pay when its a stretchor, table willing, when theres no relevant aspect.");
    			t1150 = space();
    			h324 = element("h3");
    			h324.textContent = "Compels";
    			t1152 = space();
    			p227 = element("p");
    			t1153 = text("Aspects can be ");
    			strong229 = element("strong");
    			strong229.textContent = "compelled";
    			t1155 = text(" to complicate the situation and earn fate points. To compel an aspect, the GM or a player offers a fate point to the player whose character is being compelled, and tells them why an aspect is making things more difficult or complicated. If you refuse the compel, you must spend a fate point from your own supply and describe how your character avoids the complication. Yes, this means that if you dont have any fate points, you cant refuse a compel!");
    			t1156 = space();
    			p228 = element("p");
    			strong230 = element("strong");
    			strong230.textContent = "Any aspect can be compelled";
    			t1158 = text("  whether its a character aspect, situation aspect, or consequencebut it must be something that affects the character being compelled.");
    			t1159 = space();
    			p229 = element("p");
    			strong231 = element("strong");
    			strong231.textContent = "Anyone can offer a compel.";
    			t1161 = text(" The player proposing the compel must spend one of their own fate points. The GM then takes over running the compel for the affected target. The GM does not lose a fate point by offering a compelthey have a limited pool of fate points for invoking aspects, but can compel as much as theyd like.");
    			t1162 = space();
    			p230 = element("p");
    			strong232 = element("strong");
    			strong232.textContent = "Compels can be retroactive.";
    			t1164 = text(" If a player finds they have roleplayed themself into a complication related to one of their aspects or a situation aspect that concerns them, they can ask the GM if that counts as a ");
    			strong233 = element("strong");
    			strong233.textContent = "self-compel";
    			t1166 = text(". If the group agrees, the GM slides the player a fate point.");
    			t1167 = space();
    			p231 = element("p");
    			strong234 = element("strong");
    			strong234.textContent = "Its okay to recognize a compel as off-the-mark and withdraw it.";
    			t1169 = text(" If the group agrees that a proposed compel wasnt appropriate, it should be withdrawn at no cost to the compelled character.");
    			t1170 = space();
    			h419 = element("h4");
    			h419.textContent = "Compels Are Complications, Not Stymies";
    			t1172 = space();
    			p232 = element("p");
    			p232.textContent = "When offering a compel, make sure that the complication is a course of action or major change in circumstance, not a denial of options.";
    			t1174 = space();
    			p233 = element("p");
    			p233.textContent = "Oh, youve got sand in your eyes, so you shoot at the creature and miss, is not a compel. It denies action rather than complicating anything.";
    			t1176 = space();
    			p234 = element("p");
    			p234.textContent = "You know, curse your luck, I think that the sand in your eyes means you cant really see anything. Your shots at the shoggoth go wild, puncturing a few barrels that are now gushing gasoline toward the fire pit. This is a much better compel. It changes the scene, ratchets up the tension, and gives the players something new to think about.";
    			t1178 = space();
    			p235 = element("p");
    			t1179 = text("For some ideas about what does and doesnt work as a compel, check out the discussion of types of compels found in ");
    			em31 = element("em");
    			em31.textContent = "Fate Core System";
    			t1181 = text(" starting on page 72 of that book, or online at: ");
    			a3 = element("a");
    			em32 = element("em");
    			em32.textContent = "https://fate-srd.com/fate-core/invoking-compelling-aspects#types-of-compels";
    			t1183 = space();
    			h420 = element("h4");
    			h420.textContent = "Events and Decisions";
    			t1185 = space();
    			p236 = element("p");
    			t1186 = text("There are two general kinds of compels: ");
    			strong235 = element("strong");
    			strong235.textContent = "events";
    			t1188 = text(" and ");
    			strong236 = element("strong");
    			strong236.textContent = "decisions";
    			t1190 = text(".");
    			t1191 = space();
    			p237 = element("p");
    			p237.textContent = "An event compel is something that happens to a character because of an external force. That external force connects with the aspect in some way, resulting in an unfortunate complication.";
    			t1193 = space();
    			p238 = element("p");
    			p238.textContent = "A decision compel is internal, where the characters flaws or competing values get in the way of better judgment. The aspect guides the character to make a particular choiceand the fallout of that choice creates a complication for them.";
    			t1195 = space();
    			p239 = element("p");
    			p239.textContent = "In either case, a resulting complication is key! Without a complication, there is no compel.";
    			t1197 = space();
    			h421 = element("h4");
    			h421.textContent = "Hostile Invocations or Compels?";
    			t1199 = space();
    			p240 = element("p");
    			p240.textContent = "Dont confuse hostile invocations and compels! Though they are similarthey are ways to give a character an immediate problem in exchange for a fate pointthey work differently.";
    			t1201 = space();
    			p241 = element("p");
    			t1202 = text("A compel creates a ");
    			em33 = element("em");
    			em33.textContent = "narrative change";
    			t1204 = text(". The decision to compel a characters aspect isnt something that happens in-universe; rather, its the GM or player proposing a change to the story. The effect can be broad, but the target gets the fate point immediately if they accept the compel, and may choose to refuse the compel.");
    			t1205 = space();
    			p242 = element("p");
    			t1206 = text("A hostile invocation is a ");
    			em34 = element("em");
    			em34.textContent = "mechanical effect";
    			t1208 = text(". The target doesnt get a chance to refuse the invocationbut as with any invocation, you will need to explain how that aspect makes sense to invoke. And while they do get a fate point, they dont get to use it in the current scene. However, the ultimate result is much more constrained: a +2 bonus or one reroll of the dice.");
    			t1209 = space();
    			p243 = element("p");
    			t1210 = text("Compels let you, as a player or GM, change what a scene is ");
    			em35 = element("em");
    			em35.textContent = "about";
    			t1212 = text(". They throw a wrench in the narrative. Using them against an opponent is a risky propositionthey might refuse, or accomplish their objective despite the complication thanks to the shiny new fate point you handed them.");
    			t1213 = space();
    			p244 = element("p");
    			p244.textContent = "Hostile invocations help you in the current moment. In addition to your own aspects, you have your opponents aspects available to invoke, giving you more options and making scenes more dynamic and connected.";
    			t1215 = space();
    			h210 = element("h2");
    			h210.textContent = "How Can I Add and Remove Aspects?";
    			t1217 = space();
    			hr16 = element("hr");
    			t1218 = space();
    			p245 = element("p");
    			t1219 = text("You can create or discover a situation aspect using the create an advantage action (");
    			strong237 = element("strong");
    			strong237.textContent = "page XX";
    			t1221 = text("). You may also create boosts that way, or as a result of a tie or success with style when you overcome an obstacle, attack, or defend.");
    			t1222 = space();
    			p246 = element("p");
    			t1223 = text("You can remove an aspect provided you can think of a way your character could do soblast the ");
    			strong238 = element("strong");
    			strong238.textContent = "Raging Fire";
    			t1225 = text(" with a fire extinguisher, use evasive maneuvers to escape the pursuing guard thats ");
    			strong239 = element("strong");
    			strong239.textContent = "On Your Tail";
    			t1227 = text(". Depending on the situation, that might require an overcome action (");
    			strong240 = element("strong");
    			strong240.textContent = "page XX";
    			t1229 = text("); in this case, an opponent could use a defend action to try to preserve the aspect, if they can describe how they do so.");
    			t1230 = space();
    			p247 = element("p");
    			t1231 = text("However, if theres no narrative block to removing an aspect, you can simply do so. If youre ");
    			strong241 = element("strong");
    			strong241.textContent = "All Tied Up";
    			t1233 = text(" and then a friend unties you, the aspect goes away. If theres nothing stopping you, theres no need to roll.");
    			t1234 = space();
    			h211 = element("h2");
    			h211.textContent = "Other Kinds of Aspects";
    			t1236 = space();
    			hr17 = element("hr");
    			t1237 = space();
    			p248 = element("p");
    			t1238 = text("Weve covered the standard aspect types on ");
    			strong242 = element("strong");
    			strong242.textContent = "page XX";
    			t1240 = text(". These additional types are optional, but may add value to your game. To some extent these are variants on character aspects (if you expand your notion of what counts as a character) and situation aspects (if you change your notion of how long those last).");
    			t1241 = space();
    			p249 = element("p");
    			strong243 = element("strong");
    			strong243.textContent = "Organization aspects:";
    			t1243 = text(" Sometimes you might be dealing with a whole organization that operates under a certain set of principles. Consider giving the organization aspects which any member of it can access as if it were their own.");
    			t1244 = space();
    			p250 = element("p");
    			strong244 = element("strong");
    			strong244.textContent = "Scenario aspects:";
    			t1246 = text(" Sometimes a particular plot might introduce a new trope that shows up time and again in the storyline. Consider defining this as an aspect which is available to all characters in the story until that part of the story concludes.");
    			t1247 = space();
    			p251 = element("p");
    			strong245 = element("strong");
    			strong245.textContent = "Setting aspects:";
    			t1249 = text(" Like a scenario aspect, the setting of your campaign itself may have recurring themes. Unlike a scenario aspect, these aspects dont go away.");
    			t1250 = space();
    			p252 = element("p");
    			strong246 = element("strong");
    			strong246.textContent = "Zone aspects:";
    			t1252 = text(" You can attach situation aspects to a particular place on the map represented by a zone (");
    			strong247 = element("strong");
    			strong247.textContent = "pageXX";
    			t1254 = text("). This can add extra dynamism to your groups interactions with the map. A GM can encourage this by making an up for grabs free invoke available on a zone aspect at the start of the scene, drawing characters (player and non-player alike) to leverage that aspect as part of their early strategy.");
    			t1255 = space();
    			h16 = element("h1");
    			h16.textContent = "Challenges, Conflicts, and Contests";
    			t1257 = space();
    			hr18 = element("hr");
    			t1258 = space();
    			p253 = element("p");
    			t1259 = text("Many times, you will be able to resolve an action with a single roll of the dicedo you crack the safe, avoid security, or convince the reporter to give you their notes? Other times youll face extended engagements that take many rolls to resolve. For those cases, we offer three resolution tools: ");
    			strong248 = element("strong");
    			strong248.textContent = "challenges";
    			t1261 = text(", ");
    			strong249 = element("strong");
    			strong249.textContent = "contests";
    			t1263 = text(", and ");
    			strong250 = element("strong");
    			strong250.textContent = "conflicts";
    			t1265 = text(". Each does things a little differently, depending on the goal of the engagement and the opposition involved.");
    			t1266 = space();
    			ul15 = element("ul");
    			li72 = element("li");
    			strong251 = element("strong");
    			strong251.textContent = "A challenge is a complicated or dynamic situation.";
    			t1268 = text(" Youll be opposed by someone or something, but there isnt a dominant other side. This is how you might play out a researcher looking for clues in an ancient tome, the party negotiator distracting the librarian, and the bruiser holding back untold horrors from entering the library all at the same time.");
    			t1269 = space();
    			li73 = element("li");
    			strong252 = element("strong");
    			strong252.textContent = "A contest is a situation where two or more parties are pursuing mutually exclusive goals, but not actively harming one another.";
    			t1271 = text(" Contests are perfect for chases, debates, and races of all sorts. (And just because the parties are not trying to harm each other doesnt mean that harm cant befall them!)");
    			t1272 = space();
    			li74 = element("li");
    			strong253 = element("strong");
    			strong253.textContent = "A conflict is when characters can and want to harm one another.";
    			t1274 = text(" Wrestling in the mud with a cultist as knives stab at bellies, riddling a swarm of ghouls with bullets as their claws rake at your flesh, and an exchange of vicious barbs with your rival under the watchful eye of the queenthese are all conflicts.");
    			t1275 = space();
    			h212 = element("h2");
    			h212.textContent = "Setting Up Scenes";
    			t1277 = space();
    			hr19 = element("hr");
    			t1278 = space();
    			p254 = element("p");
    			p254.textContent = "Regardless of the type of scene, the GM will start by setting the essential pieces into place, so that the players know what resources are available and what complications are in play.";
    			t1280 = space();
    			h325 = element("h3");
    			h325.textContent = "Zones";
    			t1282 = space();
    			p255 = element("p");
    			strong254 = element("strong");
    			strong254.textContent = "Zones";
    			t1284 = text(" are a representation of the physical spacea quick map broken into a few discrete sections. A conflict in a remote farmhouse might have four zones: the first floor, second floor, front yard, and back woods. Two to four zones are sufficient to handle most conflicts. Large or complicated scenes may require more. Try to keep your zone map to a simple sketch, something that fits on a note card or can be quickly drawn on a whiteboard.");
    			t1285 = space();
    			p256 = element("p");
    			p256.textContent = "Zones help guide the story by shaping what is possible. Who you can attack and where you can move depend on the zone youre in.";
    			t1287 = space();
    			p257 = element("p");
    			strong255 = element("strong");
    			strong255.textContent = "Anyone in a zone can interact with everyone and everything in that zone.";
    			t1289 = text(" This means you can hit, stab, or otherwise physically engage with people and things in your zone. Need to open that wall safe in the bedroom? Youll have to be in that zone. Anything outside your zone is usually beyond your reachyoull need to move to get there, or use something that can extend your reach there (telekinesis, a gun, etc).");
    			t1290 = space();
    			p258 = element("p");
    			t1291 = text("Moving between zones is easy, as long as theres nothing in your way. ");
    			strong256 = element("strong");
    			strong256.textContent = "You can move to an adjacent zone in addition to your action during an exchange (**";
    			t1293 = text("page XX**");
    			strong257 = element("strong");
    			strong257.textContent = ") as long as nothing is in your way.";
    			t1295 = text(" If your movement is impeded, it takes your action to do so. Make an overcome roll to climb a wall, rush past a group of cultists, or leap across rooftops. If you fail, you stay in your zone or the movement costs you something. You can also use your action to move ");
    			em36 = element("em");
    			em36.textContent = "anywhere";
    			t1297 = text(" on the mapthough the GM is within rights to set a high difficulty if its an epic movement.");
    			t1298 = space();
    			p259 = element("p");
    			p259.textContent = "If something isnt risky or interesting enough to merit a roll, then it isnt an impediment to movement. For instance, you dont need to use up your action opening an unlocked doorthats just a part of the movement.";
    			t1300 = space();
    			p260 = element("p");
    			p260.textContent = "Shooting lets you attack from a distance. Ranged attacks can target enemies in adjacent zones or maybe further, if the zones are clear enough. If theres a creature rooting around in the bedroom upstairs and around the corner, you cant shoot it from the bottom of the stairs. Pay attention to the way the zones and situation aspects are set up when deciding whats fair game or not.";
    			t1302 = space();
    			h326 = element("h3");
    			h326.textContent = "Situation Aspects";
    			t1304 = space();
    			p261 = element("p");
    			p261.textContent = "When setting the scene, the GM should think of interesting and dynamic environmental features that can constrain the action or provide opportunities to change the situation by using them. Three to five details are more than enough. Use these categories as a guide:";
    			t1306 = space();
    			ul16 = element("ul");
    			li75 = element("li");
    			strong258 = element("strong");
    			strong258.textContent = "Tone, mood, or weather";
    			t1308 = text("  darkness, lightning, and howling winds");
    			t1309 = space();
    			li76 = element("li");
    			strong259 = element("strong");
    			strong259.textContent = "Impediments to movement";
    			t1311 = text("  connected by ladders, covered in slime, and filled with smoke");
    			t1312 = space();
    			li77 = element("li");
    			strong260 = element("strong");
    			strong260.textContent = "Cover and obstructions";
    			t1314 = text("  vehicles, pillars, and crates");
    			t1315 = space();
    			li78 = element("li");
    			strong261 = element("strong");
    			strong261.textContent = "Dangerous features";
    			t1317 = text("  crates of TNT, barrels of oil, and eldritch artifacts crackling with electricity");
    			t1318 = space();
    			li79 = element("li");
    			strong262 = element("strong");
    			strong262.textContent = "Usable objects";
    			t1320 = text("  improvised weapons, statues or bookshelves to knock over, and doors to be barred");
    			t1321 = space();
    			p262 = element("p");
    			t1322 = text("Anyone can invoke and compel these aspects, so remember to take them into account when you wrestle that cultist to the ground amid the ");
    			strong263 = element("strong");
    			strong263.textContent = "Caustic Slime Covering Everything";
    			t1324 = text(".");
    			t1325 = space();
    			p263 = element("p");
    			t1326 = text("More situation aspects can be written down as the scene plays out. If it makes sense that there are ");
    			strong264 = element("strong");
    			strong264.textContent = "Deep Shadows";
    			t1328 = text(" in the recesses of the catacombs, go ahead and write that down when a player asks if there are any shadows they can use to hide. Other aspects come into play because characters use the create an advantage action. Things like ");
    			strong265 = element("strong");
    			strong265.textContent = "Flames Everywhere!";
    			t1330 = text(" dont just happen without character action. Well. Usually.");
    			t1331 = space();
    			h422 = element("h4");
    			h422.textContent = "Free Invokes on the scenes aspects?";
    			t1333 = space();
    			p264 = element("p");
    			p264.textContent = "Its up to the GM to decide if a situation aspect arising from the scenes setup provides a free invoke to the players (or even to the NPCs). Some of the scenes aspects might provide a clever player just the advantage they need right awayand a free invoke can be a strong incentive to drive players to interact with the environment. Free invokes also might end up on the scenes aspects at the start due to preparations made in advance.";
    			t1335 = space();
    			h423 = element("h4");
    			h423.textContent = "Zone Aspects";
    			t1337 = space();
    			p265 = element("p");
    			t1338 = text("A mentioned on ");
    			strong266 = element("strong");
    			strong266.textContent = "page XX";
    			t1340 = text(", Some situation aspects might apply to specific zones on the map, and not others. Thats okayit can add some extra texture, opportunity, and challenge to the map that might be lacking otherwise.");
    			t1341 = space();
    			h327 = element("h3");
    			h327.textContent = "Turn Order";
    			t1343 = space();
    			p266 = element("p");
    			t1344 = text("Often, you wont need to know who is acting precisely when, but in contests and conflicts turn order can become important. These scenes take place over a series of ");
    			strong267 = element("strong");
    			strong267.textContent = "exchanges";
    			t1346 = text(". In an exchange, each involved character can take one overcome, create an advantage, or attack action, and can move once. (Contests work slightly differently; see ");
    			strong268 = element("strong");
    			strong268.textContent = "page XX";
    			t1348 = text(".) Because defending is a reaction to someone elses action, characters can defend as many times as they need to during other characters turns, so long as they can justify their ability to interfere based on whats already been established in the story.");
    			t1349 = space();
    			p267 = element("p");
    			p267.textContent = "At the start of a scene, the GM and players decide who goes first based on the situation, then the active player picks who goes next. The GMs characters are selected in the turn order just like the PCs, with the GM deciding who goes next after the NPCs have acted. After everyone has taken a turn, the last player picks who goes next at the start of the next exchange.";
    			t1351 = space();
    			p268 = element("p");
    			t1352 = text("Cassandra and Ruth have stumbled across a small group of cultists, led by an acolyte in a golden mask, performing some arcane ritual. Because the cultists are focused on their work, the GM declares that the PCs will go first in this conflict. The players decide that Cassandra will act first: she creates an advantage against the masked cultist, ");
    			strong269 = element("strong");
    			strong269.textContent = "Distracted";
    			t1354 = text(", by running directly at them screaming. Its crude but effective. To make the best use of the situation aspect, Cassandras player decides that Ruth should go next. Ruth throws a dagger at the masked acolyte, and immediately invokes ");
    			strong270 = element("strong");
    			strong270.textContent = "Distracted";
    			t1356 = text(" to improve her attack. Its not enough to take out the acolyte in one hit, but it is a one-two punch that leaves the cultist reeling.");
    			t1357 = space();
    			p269 = element("p");
    			p269.textContent = "Unfortunately, now that all the PCs in the scene have acted, Ruth has no choice but to pick one of the cultists to go next. She chooses the masked acolyte. The GM smiles, because they know that once the acolyte acts, she can have the cultists act until the end of the round, at which point they can choose the masked acolyte to start the next exchange. The PCs may have gotten a good first hit in, but now the cultists get to fight back.";
    			t1359 = space();
    			p270 = element("p");
    			t1360 = text("This method of determining turn order goes by several names in online discussion: elective action order, and popcorn, handoff, or Balsera Style initiative, the last one named after Fate Core author Leonard Balsera, who planted the seed of the idea. You can learn more about this method and its strategies at ");
    			a4 = element("a");
    			a4.textContent = "https://www.deadlyfredly.com/2012/02/marvel/";
    			t1362 = space();
    			h213 = element("h2");
    			h213.textContent = "Teamwork";
    			t1364 = space();
    			hr20 = element("hr");
    			t1365 = space();
    			p271 = element("p");
    			p271.textContent = "Fate offers three methods for teamwork: combining the same skill from multiple characters on a single roll, stacking free invokes by creating advantages to set up a team member for success, and invoking aspects on an allys behalf.";
    			t1367 = space();
    			p272 = element("p");
    			p272.textContent = "When you combine skills, figure out who has the highest level in the skill among the participants. Each other participant who has at least Average(+1) in that skill adds a +1 to the highest persons skill level. Providing support like this uses your action. Supporters face the same costs and consequences as the person making the roll. The maximum total bonus a team may provide this way is equal to the highest persons skill level.";
    			t1369 = space();
    			p273 = element("p");
    			p273.textContent = "Otherwise, you can create an advantage on your turn and let an ally use the free invokes when it makes sense that they can. Outside of your turn, you may invoke an aspect to add a bonus to someone elses roll.";
    			t1371 = space();
    			h214 = element("h2");
    			h214.textContent = "Challenges";
    			t1373 = space();
    			hr21 = element("hr");
    			t1374 = space();
    			p274 = element("p");
    			p274.textContent = "Many of the difficulties your characters face can be handled with a single roll in the course of a scenedisarm the bomb, find the tome of eldritch lore, or decode the cypher. But sometimes things are more fluid, more complicated, and its just not as simple as finding the tome of eldritch lore because the yacht youre searching is careening through Hong Kong harbor while a monsoon rages outside and the boats library is on firewhich is totally not your fault.";
    			t1376 = space();
    			p275 = element("p");
    			t1377 = text("In complicated circumstances with no opposition, youll want to use a ");
    			strong271 = element("strong");
    			strong271.textContent = "challenge";
    			t1379 = text(": a series of overcome actions that tackle a bigger issue. Challenges let the entire group work together in a scene, and they keep things dynamic.");
    			t1380 = space();
    			p276 = element("p");
    			p276.textContent = "To set up a challenge, the GM considers the situation and picks a number of skills that can contribute to the success of the group. Treat each action as a separate overcome roll. Teamwork actions are allowed, but may introduce costs or complications, such as running out of time or other inefficiencies.";
    			t1382 = space();
    			p277 = element("p");
    			p277.textContent = "GMs, do your best to give each character in the scene an opportunity to contributeaim for a number of skills equal to the number of characters involved. Downsize if you expect to have some of the characters pulled away or distracted by other priorities, or if you want to make room for teamwork. For more difficult challenges, build the challenge with more needed actions than there are characters, in addition to adjusting the difficulties of the actions.";
    			t1384 = space();
    			p278 = element("p");
    			p278.textContent = "After the rolls have been made, the GM will evaluate the successes, failures, and costs of each action as they interpret how the scene proceeds. It could be that the results lead into another challenge, a contest, or even a conflict. A mix of successes and failures should allow the characters to move forward with a partial victory as they face new entangling complications.";
    			t1386 = space();
    			h215 = element("h2");
    			h215.textContent = "Contests";
    			t1388 = space();
    			hr22 = element("hr");
    			t1389 = space();
    			p279 = element("p");
    			t1390 = text("A ");
    			strong272 = element("strong");
    			strong272.textContent = "contest";
    			t1392 = text(" is when two or more sides are in direct opposition but there isnt a conflict. This doesnt mean one side doesnt ");
    			em37 = element("em");
    			em37.textContent = "want";
    			t1394 = text(" to hurt the other. Contests may involve the group trying to escape a threat before it cuts off any chance of victory.");
    			t1395 = space();
    			p280 = element("p");
    			t1396 = text("At the start of a contest, everyone involved declares their intent, what they hope to get out of it. If there are multiple PCs involved, they can be on the same or different sides, depending on their goals");
    			em38 = element("em");
    			em38.textContent = "e.g.,";
    			t1398 = text(" in a foot race, each character might be on their own side. ");
    			strong273 = element("strong");
    			strong273.textContent = "In a contest, the PCs cant or arent trying to harm the enemy.";
    			t1400 = text(" External threats (e.g., erupting volcano, angry god) may attack any or all sides; those threats might also be a participant in the contest.");
    			t1401 = space();
    			p281 = element("p");
    			p281.textContent = "Contests take place over a series of exchanges. Each side takes one overcome action to do something to achieve their goals during each exchange. Only one character on each side takes the overcome action in each exchange, but their allies can provide teamwork and try to create advantages to assist (which comes with some risksee below). The overcome actions can be against passive difficultiesif the contestants are facing separate environmental challengesor compared against one another when theyre in direct competition.";
    			t1403 = space();
    			p282 = element("p");
    			t1404 = text("At the end of each exchange, compare the efforts of each sides action. The side with the highest effort marks a ");
    			strong274 = element("strong");
    			strong274.textContent = "victory";
    			t1406 = text(". If the victor succeeds with styleand no one else didthen they mark ");
    			strong275 = element("strong");
    			strong275.textContent = "two";
    			t1408 = text(" victories. The first one to three victories wins the contest. (You can always decide instead to run an extended contest requiring more victories, though we recommend no more than five.)");
    			t1409 = space();
    			p283 = element("p");
    			t1410 = text("When theres a tie for the highest effort, no one marks a victory, and an ");
    			strong276 = element("strong");
    			strong276.textContent = "unexpected twist";
    			t1412 = text(" happens. The GM will introduce a new situation aspect to reflect how the scene, terrain, or situation has changed.");
    			t1413 = space();
    			p284 = element("p");
    			p284.textContent = "In contests where a threate is trying to harm any of the contestants, everyone on a side takes a hit when their contest roll is lower than the threat's attack roll or static difficulty rating. They take shifts equal to the shifts of failure. Just like in a conflict, if a character cant absorb all the shifts of a hit, they are taken out.";
    			t1415 = space();
    			h328 = element("h3");
    			h328.textContent = "Creating Advantages in a Contest";
    			t1417 = space();
    			p285 = element("p");
    			t1418 = text("During any exchange, your side can try to create advantages before making your overcome roll. The target, or anyone else who can reasonably interfere, may oppose with a defend roll as normal. Each participant may attempt to create an advantage in addition to rolling or providing a teamwork bonus (");
    			strong277 = element("strong");
    			strong277.textContent = "page XX";
    			t1420 = text("). If you fail to create an advantage, you have a choice: either your side forfeits its overcome roll, or you may succeed at a cost (preserving your roll or teamwork bonus) by giving the other side a free invoke instead. If you at least tie, proceed as normal with your roll or bonus.");
    			t1421 = space();
    			h216 = element("h2");
    			h216.textContent = "Conflicts";
    			t1423 = space();
    			hr23 = element("hr");
    			t1424 = space();
    			p286 = element("p");
    			t1425 = text("When the heroes get into a straight-up fightwhether with the authorities, cultists, or some unspeakable horrorand can win, you have a ");
    			strong278 = element("strong");
    			strong278.textContent = "conflict";
    			t1427 = text(". In other words, use conflicts when violence or coercion is a reasonable means to the ends of the PCs.");
    			t1428 = space();
    			p287 = element("p");
    			t1429 = text("Conflicts may seem the most straightforwardafter all, the history of roleplaying games is built on combat simulators. But keep in mind a key part of their description: the characters involved have the capability to harm ");
    			em39 = element("em");
    			em39.textContent = "each other";
    			t1431 = text(". If its one-sidedsay youre trying to punch a living mountaintheres no chance you can hurt it. Thats not a conflict. Thats a contest, probably where the PCs are trying to escape or find the means to fight back.");
    			t1432 = space();
    			p288 = element("p");
    			p288.textContent = "Conflicts can be physical or mental. Physical conflicts can be shoot-outs, sword-fights, or ramming extradimensional beings with trucks. Mental conflicts include arguments with loved ones, interrogations, and eldritch assaults upon the mind.";
    			t1434 = space();
    			p289 = element("p");
    			t1435 = text("Timing matters when using some kinds of teamwork (");
    			strong279 = element("strong");
    			strong279.textContent = "page XX";
    			t1437 = text("). You can invoke an aspect on your allys behalf to improve their roll at any time. You can help an ally ");
    			em40 = element("em");
    			em40.textContent = "before";
    			t1439 = text(" their turn comes around by creating an advantage or giving a +1 bonus as your action. If they take their turn ahead of you in the exchange, you cant create an advantage to help them, but you can use up your turn (skipping it for that exchange) to give them a +1 teamwork bonus.");
    			t1440 = space();
    			h329 = element("h3");
    			h329.textContent = "Taking Harm";
    			t1442 = space();
    			p290 = element("p");
    			p290.textContent = "When an attack is successful, the defender must absorb the hit, which has shifts equal to the difference between the attacks effort and defenses effort.";
    			t1444 = space();
    			p291 = element("p");
    			t1445 = text("You can absorb shifts of a hit by marking stress boxes and by taking consequences. If you cant or dont absorb all of the shifts, you are ");
    			strong280 = element("strong");
    			strong280.textContent = "taken out";
    			t1447 = text(" (");
    			strong281 = element("strong");
    			strong281.textContent = "page XX";
    			t1449 = text(")youre removed from the scene, and the attacker decides how it plays out.");
    			t1450 = space();
    			p292 = element("p");
    			p292.textContent = "A series of regrettable decisions has put Charles in a dank basement, confronting a ghoul that very much wants to eat him. The ghoul attacks, lunging with its sharp claws; this is an attack using its Fair(+2) Fight. The GM rolls [0][0][+][+], bringing the effort up to Great(+4). Charles tries to leap out of the way with his Good(+3) Athletics, but rolls [0][0][0][-], taking his effort down to Fair(+2). Because the ghouls attack effort was two steps higher than Charless defense effort, Charles must absorb two shifts. He marks the first two of his three physical stress boxes; already the fight is proving dangerous.";
    			t1452 = space();
    			h424 = element("h4");
    			h424.textContent = "Stress";
    			t1454 = space();
    			p293 = element("p");
    			t1455 = text("Simply put, ");
    			strong282 = element("strong");
    			strong282.textContent = "stress";
    			t1457 = text(" is plot armor. Its a resource used to keep your character up and in the fight when their foes hit them. When you mark stress boxes to absorb a hit, youre saying things like, That ");
    			em41 = element("em");
    			em41.textContent = "just";
    			t1459 = text(" missed me, or Whoa, that knocked the wind out of me but Im okay. That said, its a limited resourcemost characters only have three boxes for physical stress and three boxes for mental stress, though characters with high Will or Physique have more.");
    			t1460 = space();
    			p294 = element("p");
    			t1461 = text("Youll find two ");
    			strong283 = element("strong");
    			strong283.textContent = "stress tracks";
    			t1463 = text(" on your character sheet, one for physical harm and one for mental harm. When you take a hit, you can mark empty stress boxes of the appropriate type to absorb it and stay in the fight. Each stress box you mark absorbs one shift. You can mark multiple stress boxes if you need to.");
    			t1464 = space();
    			p295 = element("p");
    			p295.textContent = "The boxes are binaryeither theyre empty and can be used or theyre full and cant. Thats okay, though. Youll clear the stress track as soon as you make it through the sceneprovided the monsters dont eat you first.";
    			t1466 = space();
    			h425 = element("h4");
    			h425.textContent = "Consequences";
    			t1468 = space();
    			p296 = element("p");
    			strong284 = element("strong");
    			strong284.textContent = "Consequences";
    			t1470 = text(" are new aspects you write on your character sheet when your character takes a hit, representing the real harm and injury your character suffers.");
    			t1471 = space();
    			p297 = element("p");
    			t1472 = text("When you take a consequence to absorb a hit, write an aspect in an empty consequence slot that describes what harm befalls your character. Use the severity of the consequence as a guide: If you were bitten by star spawn, a mild consequence might be ");
    			strong285 = element("strong");
    			strong285.textContent = "Nasty Bite";
    			t1474 = text(", but a moderate consequence could be ");
    			strong286 = element("strong");
    			strong286.textContent = "Bite That Wont Stop Bleeding";
    			t1476 = text(", and a severe consequence might be ");
    			strong287 = element("strong");
    			strong287.textContent = "Crippled Leg";
    			t1478 = text(".");
    			t1479 = space();
    			p298 = element("p");
    			t1480 = text("While stress turns a hit into a near miss, taking a consequence means you got hit hard. Why would you take a consequence? Because sometimes stress isnt enough. Remember, you have to absorb ");
    			em42 = element("em");
    			em42.textContent = "all";
    			t1482 = text(" the shifts of the hit to stay in the fight. You only have so many stress boxes. The good news is that consequences can take pretty big hits.");
    			t1483 = space();
    			p299 = element("p");
    			p299.textContent = "Each character starts with three consequence slotsmild, moderate, and severe. Taking a minor consequence absorbs two shifts, a moderate one absorbs four shifts, and a severe one absorbs six shifts.";
    			t1485 = space();
    			p300 = element("p");
    			p300.textContent = "So, if you take a big five-shift hit, you can absorb the whole thing with a single stress box and a moderate consequence. Thats a lot more efficient than spending five of your stress boxes.";
    			t1487 = space();
    			p301 = element("p");
    			t1488 = text("The downside to consequences is that they are aspectsand aspects are always true (");
    			strong288 = element("strong");
    			strong288.textContent = "page XX";
    			t1490 = text("). So if youve got ");
    			strong289 = element("strong");
    			strong289.textContent = "Gut Shot";
    			t1492 = text(", your characters gut is shot! That will mean you cant do things a gut-shot person cant do (like run fast). If things get particularly complicated due to this, you might even face a compel on your consequence, too. And, just like the aspects you make when you create an advantage, the character that created the consequencethat is, whoever shot yougets one free invoke on that consequence. Ouch!");
    			t1493 = space();
    			p302 = element("p");
    			t1494 = text("Charles is still battling the ghoul. It claws at him, this time rolling a [0][0][+][+], adding its Fair(+2) Fight, and invokes its ");
    			strong290 = element("strong");
    			strong290.textContent = "Hungry for Flesh";
    			t1496 = text(" aspect for an additional +2, adding up to a devastating Fantastic(+6) blow. Charless [-][-][0][0], added to his Good(+3) Athletics, gives him a merely Average(+1) defense; thats five shifts he needs to absorb. He chooses to take a moderate consequence. His player and the GM decide that the ghoul gave Charles a ");
    			strong291 = element("strong");
    			strong291.textContent = "Gaping Chest Wound";
    			t1498 = text(". This consequence absorbs four of the shifts, leaving one, which Charles absorbs with his last remaining stress box.");
    			t1499 = space();
    			h426 = element("h4");
    			h426.textContent = "Getting Taken Out";
    			t1501 = space();
    			p303 = element("p");
    			t1502 = text("If you cant absorb all the shifts of a hit with stress and consequences, youre ");
    			strong292 = element("strong");
    			strong292.textContent = "taken out";
    			t1504 = text(".");
    			t1505 = space();
    			p304 = element("p");
    			p304.textContent = "Getting taken out is bad. Whoever took you out decides what happens. Given dangerous situations and powerful enemies, this could mean youre dead, but thats not the only possibility. The outcome must be in keeping with the scope and scale of the conflict at handyou wont die of shame if you lose an argumentbut changes to your character sheet (and more) are possible. The outcome should also fit within the boundaries your group has establishedif your group feels that characters should never get killed without the players consent, thats perfectly valid.";
    			t1507 = space();
    			p305 = element("p");
    			p305.textContent = "But even when death is on the table (its best to be clear about that before a roll), GMs should remember that its usually a boring result. A PC thats been taken out could be lost, kidnapped, imperiled, be forced to take consequences the list goes on. A characters death means someone has to make a new character and bring them into the story, but a fate worse than death is limited only by your imagination.";
    			t1509 = space();
    			p306 = element("p");
    			p306.textContent = "Follow the fiction when describing how someoneor somethingis taken out. Was a cultist taken out by a barrage of machine gun fire? A spray of red fills the air as they slump with a wet thump to the ground. Were you hurled from the truck as it crossed the 26th Street overpass? You disappear over the edge and are left behind as the conflict rumbles on along the Dan Ryan. Keep death in mind when discussing the terms of being taken out, but often its just as interesting to cheat death.";
    			t1511 = space();
    			p307 = element("p");
    			p307.textContent = "The ghoul gets in a very lucky hit, dealing a Legendary(+8) attack against Charless Poor (-1) defense. By this point in the conflict, all of Charless stress boxes are full, as is his moderate consequence slot. Even if he were to take a mild and a severe consequence at once, absorbing eight shifts, it wouldnt be enough. As a result, Charles is taken out. The ghoul gets to decide his fate. The GM would be within their rights to have the ghoul kill Charles then and therebut getting killed isnt the most interesting result.";
    			t1513 = space();
    			p308 = element("p");
    			p308.textContent = "Instead, the GM declares that Charles survives, getting knocked out and dragged to the ghouls lair, consequences intact. Charles will wake up lost and very fragile in the pitch-dark catacombs beneath the city. Because he was taken out, Charles has no choice but to accept the terms laid before him.";
    			t1515 = space();
    			h427 = element("h4");
    			h427.textContent = "Conceding";
    			t1517 = space();
    			p309 = element("p");
    			t1518 = text("So how do you keep from dying horriblyor worse? You can interrupt any action in a conflict to ");
    			strong293 = element("strong");
    			strong293.textContent = "concede";
    			t1520 = text(" as long as the dice havent hit the table yet. Just give in. Tell everyone that youre done, that you cant keep going. Your character loses and exits the conflict, but ");
    			strong294 = element("strong");
    			strong294.textContent = "you gain a fate point";
    			t1522 = text(" plus an extra one for each consequence they took in the current conflict.");
    			t1523 = space();
    			p310 = element("p");
    			t1524 = text("Also, concession means ");
    			em43 = element("em");
    			em43.textContent = "you";
    			t1526 = text(" declare the terms of your loss and how you exit the conflict. You can escape the monsters and live to fight another day. It is a loss, though. Youll have to give your foe something they want. You cant concede and describe how you heroically save the daythats not on the table anymore.");
    			t1527 = space();
    			p311 = element("p");
    			t1528 = text("Conceding is a powerful tool. You can concede to escape with an action plan for the next fight, a clue as to where to go, or some advantage going forward. You just cant win ");
    			em44 = element("em");
    			em44.textContent = "this";
    			t1530 = text(" fight.");
    			t1531 = space();
    			p312 = element("p");
    			p312.textContent = "You must concede before your opponent rolls the dice. You cant wait to see the outcome of the dice and concede when its obvious you cant winthats poor form.";
    			t1533 = space();
    			p313 = element("p");
    			p313.textContent = "Some negotiation is expected, here. Look for a solution that works for everyone at the table. If the opposition isnt on board with the terms of your concession, they can push for rewording those terms, or ask that you sacrifice something different or extra. Because a concession is still a loss for you, that does mean the other side should gain at least part of what theyre after.";
    			t1535 = space();
    			p314 = element("p");
    			p314.textContent = "The more significant the cost you pay, the greater the benefit your side should receive as part of the concessionif certain doom is about to befall the entire group, one member choosing to concede as a heroic (and fatal) last stand could mean everyone else is spared!";
    			t1537 = space();
    			h330 = element("h3");
    			h330.textContent = "Ending a Conflict";
    			t1539 = space();
    			p315 = element("p");
    			t1540 = text("A conflict draws to a close when everyone on one side has either conceded or been taken out. At the end of a conflict, any players who conceded collect their fate points for the concession (");
    			strong295 = element("strong");
    			strong295.textContent = "page XX";
    			t1542 = text("). The GM also pays out fate points owed to players for hostile invokes (");
    			strong296 = element("strong");
    			strong296.textContent = "page XX";
    			t1544 = text(") that happened during the conflict.");
    			t1545 = space();
    			h331 = element("h3");
    			h331.textContent = "Recovering from Conflicts";
    			t1547 = space();
    			p316 = element("p");
    			p316.textContent = "At the end of each scene, every character clears their stress boxes. Consequences take more time and effort to clear.";
    			t1549 = space();
    			p317 = element("p");
    			t1550 = text("To start the ");
    			strong297 = element("strong");
    			strong297.textContent = "recovery process";
    			t1552 = text(", the person treating you will need to succeed at an overcome action with an appropriate skill. Physical injuries typically are addressed using medical knowledge via Academics, while mental consequences are healed with Empathy. This overcome action faces difficulty equal to the severity of the consequence: Fair(+2) for a mild consequence, Great(+4) for moderate, and Fantastic(+6) for severe. These difficulties increase by two when youre trying to treat yourself (its easier to have someone else do that).");
    			t1553 = space();
    			p318 = element("p");
    			t1554 = text("If you succeed on this roll, rewrite the consequence to indicate that it is healing. A ");
    			strong298 = element("strong");
    			strong298.textContent = "Broken Arm";
    			t1556 = text(" may be rewritten as ");
    			strong299 = element("strong");
    			strong299.textContent = "Arm in a Cast";
    			t1558 = text(", for instance.");
    			t1559 = space();
    			p319 = element("p");
    			p319.textContent = "Success here is only the first hurdleit takes time to clear the consequence.";
    			t1561 = space();
    			ul17 = element("ul");
    			li80 = element("li");
    			strong300 = element("strong");
    			strong300.textContent = "Mild";
    			t1563 = text(" consequences take one full scene after treatment to clear.");
    			t1564 = space();
    			li81 = element("li");
    			strong301 = element("strong");
    			strong301.textContent = "Moderate";
    			t1566 = text(" consequences last longer, taking a full session after treatment to clear.");
    			t1567 = space();
    			li82 = element("li");
    			strong302 = element("strong");
    			strong302.textContent = "Severe";
    			t1569 = text(" consequences only clear when you reach a breakthrough (");
    			strong303 = element("strong");
    			strong303.textContent = "page XX";
    			t1571 = text(") after treatment.");
    			t1572 = space();
    			h17 = element("h1");
    			h17.textContent = "Advancement";
    			t1574 = space();
    			hr24 = element("hr");
    			t1575 = space();
    			p320 = element("p");
    			t1576 = text("As your characters muck about in the storyline, theyll grow and change. At the end of each session youll earn a ");
    			strong304 = element("strong");
    			strong304.textContent = "milestone";
    			t1578 = text(", which lets you move things around on your character sheet. As you conclude each arc of the story, youll earn a ");
    			strong305 = element("strong");
    			strong305.textContent = "breakthrough";
    			t1580 = text(", which lets you add things to your character sheet. (Learn more about sessions and arcs on ");
    			strong306 = element("strong");
    			strong306.textContent = "page XX";
    			t1582 = text(".)");
    			t1583 = space();
    			h217 = element("h2");
    			h217.textContent = "Milestones";
    			t1585 = space();
    			hr25 = element("hr");
    			t1586 = space();
    			p321 = element("p");
    			p321.textContent = "Milestones happen at the end of a session, part of the way through dealing with a story arc. They are focused on adjusting your character laterally rather than advancing the character. You may not wish to use a milestone, which is fine. It doesnt always make sense to change your character. The opportunity is there if you need it.";
    			t1588 = space();
    			p322 = element("p");
    			p322.textContent = "During a milestone, you can do one of the following:";
    			t1590 = space();
    			ul18 = element("ul");
    			li83 = element("li");
    			li83.textContent = "Switch the ranks of any two skills, or replace one Average(+1) skill with one that isnt on your sheet.";
    			t1592 = space();
    			li84 = element("li");
    			li84.textContent = "Rewrite one stunt.";
    			t1594 = space();
    			li85 = element("li");
    			li85.textContent = "Purchase a new stunt by spending 1 refresh. (Remember, you cant go below 1 refresh.)";
    			t1596 = space();
    			li86 = element("li");
    			li86.textContent = "Rewrite any one of your aspects, except your high concept.";
    			t1598 = space();
    			h218 = element("h2");
    			h218.textContent = "Breakthroughs";
    			t1600 = space();
    			hr26 = element("hr");
    			t1601 = space();
    			p323 = element("p");
    			t1602 = text("Breakthroughs are more significant, letting your character actually grow in power. A breakthrough lets you do one thing from the milestone list. On top of that, you do ");
    			em45 = element("em");
    			em45.textContent = "all";
    			t1604 = text(" of the following:");
    			t1605 = space();
    			ul19 = element("ul");
    			li87 = element("li");
    			li87.textContent = "Rewrite your characters high concept, if you care to.";
    			t1607 = space();
    			li88 = element("li");
    			li88.textContent = "If you have any moderate or severe consequences not yet in recovery, you can begin the recovery process and rename them. Any that were already in recovery may now be cleared.";
    			t1609 = space();
    			li89 = element("li");
    			li89.textContent = "Increase the skill rating of one skill by one stepeven from Mediocre(+0) to Average(+1).";
    			t1611 = space();
    			p324 = element("p");
    			p324.textContent = "If the GM feels a major plot development has concluded and its time for the characters to power up, they may also offer one or both of the following:";
    			t1613 = space();
    			ul20 = element("ul");
    			li90 = element("li");
    			li90.textContent = "Gain a point of refresh, which you can immediately spend to buy a new stunt if you like.";
    			t1615 = space();
    			li91 = element("li");
    			li91.textContent = "Increase a second skill rating by one step.";
    			t1617 = space();
    			h332 = element("h3");
    			h332.textContent = "Improving Skill Ratings";
    			t1619 = space();
    			p325 = element("p");
    			p325.textContent = "When improving a skill rating, you must maintain a column structure. Each step may not have more skills than the step below it. That may mean you need to promote a few Mediocre (+0) skills firstor, you may save up your skill points rather than spend them immediately, allowing big increases all at once.";
    			t1621 = space();
    			p326 = element("p");
    			p326.textContent = "Ruth wants to increase her Lore from Average(+1) to Fair(+2), but this means shed have four Fair(+2) skills and only three Average(+1)that wont do. Luckily, she has saved a second skill point from an earlier milestone, so she also increases her Mediocre(+0) Empathy to Average(+1). Now she has one Great(+4), two Good(+3), four Fair(+2), and four Average(+1) skills.";
    			t1623 = space();
    			table3 = element("table");
    			tbody3 = element("tbody");
    			tr25 = element("tr");
    			th8 = element("th");
    			p327 = element("p");
